INSERT INTO `dbnoticiapredio` (`idnoticiapredio`, `titulo`, `fechacreacion`, `noticiapredio`) VALUES
(3, 'SE JUEGA', '0000-00-00 00:00:00', '<p><span style="color:#000000">- Todos los suplentes y amigos de los equipos deberan ubicarse ATRAS de los arcos. No se permitira a nadie en los laterales de todas las canchas.</span></p>\r\n\r\n<p><span style="color:#000000">- Se recuerda a todos los equipos que el tiempo limite para avisar de la no concurrencia a&nbsp;alguna fecha es hasta el dia jueves inclusive. Avisando a partir del dia viernes deberan abonar multa economica para continuar en el torneo. A las 2 faltas al torneo el equipo queda EXCLUIDO. Son temas ya hablados y que figuran en el reglamento.</span></p>\r\n');
INSERT INTO `dbnoticiaprincipal` (`idnoticiaprincipal`, `titulo`, `fechacreacion`, `noticiaprincipal`) VALUES
(3, 'SE JUEGA', '2016-03-19 00:00:00', '<p><span style="color:#FF0000"><strong>- CERO TOLERANCIA:</strong></span> <span style="color:#000000">Lamentamos informar que se expulsaron los equipos Adestiempo y William Boo por agresion entre ellos en la cancha 8 a las 16.30hs el dia Lunes 20. Lamentamos la expulsion de ambos equipos, sabemos que son buena gente pero por un momento de calentura de algunos jugadores tiene que responder el equipo, como siempre, CONTROLAR LOS JUGADORES, los equipos se hacen responsables de sus jugadores sean invitados o no.&nbsp;Recordamos que tenemos el<strong> </strong></span><span style="color:#FF0000"><strong>&quot;derecho de admision&quot;</strong></span><span style="color:#000000"> y si algun equipo o jugador&nbsp;no se comporta de manera educada y controlada dentro de la cancha y el predio como lo buscamos nosotros sera&nbsp;excluido, no queremos perder el gran ambiente que tanto nos costo armar por algunos que no saben comportarse.</span></p>\r\n');
INSERT INTO `dbnoticias` (`idnoticia`, `titulo`, `fechacreacion`, `parrafo`, `galeria`) VALUES
(8, 'VOLVEMOS !!!', '2016-03-03 00:00:00', '<p>&nbsp;/// GENERAL ///</p>\n\n<p>Dejamos los horarios de la fecha 1 de Futbol 11 y fecha 10 de Futbol 7.</p>\n\n<p>Arriba pueden buscarse en las zonas de cada torneo que ya&nbsp;est&aacute;n&nbsp;actualizadas.</p>\n\n<p>Queremos felicitar y agradecer a todos los equipos por seguir eligiendonos, a los nuevos y a los de siempre. Como ya saben, por favor cualquier queja, consulta, duda o sugerencia con respecto a lo que fuera (&aacute;rbitros, canchas, pelotas, planilleros, organizaci&oacute;n) por favor dec&iacute;rnosla para tratar de mejorar. Recuerden que el aumento del valor de los partidos es a partir de este s&aacute;bado.</p>\n\n<p>Creemos que estamos en todos los aspectos en un muy buen nivel, las canchas que se vienen mejorando desde diciembre quedaron muy buenas, a la &uacute;nica que le falta un poco es a la 8, los &aacute;rbitros sacando los errores comunes de todo arbitro o partido la conducta que tienen de respeto para con los jugadores mejoro much&iacute;simo, las pelotas hicimos el recambio y son siempre de la mejor calidad que hay en el mercado (adidas y nike), seguimos siendo el predio con mas servicios de la Ciudad de La Plata ( DOS ambulancias con medico, seguridad, alcanza-pelotas, vestuarios con duchas calientes, fot&oacute;grafo, agua en todas las canchas, buffet, estacionamiento privado y gratis), seguimos manteniendo todos los premios, hicimos varias mejoras est&eacute;ticas en el buffet y el predio en general para que vengan con la familia y nos quedan muchas por hacer y lo mas importante que nunca vamos a ceder seguimos con la BUENA CONDUCTA y el BUEN AMBIENTE en el predio, algo fundamental que nos caracteriza.</p>\n\n<p>Como un plus, para este s&aacute;bado ya va a estar la web nueva con informaci&oacute;n, estad&iacute;sticas e historial de todos los planteles y torneos y las estad&iacute;sticas de cada fecha el mismo s&aacute;bado o domingo a mas tardar.</p>\n\n<p>Como ya saben, lleguen temprano, a los 10min. de demora sacamos 1pto de la tabla de posiciones, traigan DNI y vengan a divertirse.</p>\n\n<p>Nos vemos!</p>\n\n<p>&nbsp;</p>\n\n<p>/// FUTBOL 7 ///</p>\n\n<p>Aclaramos algunas dudas con respecto al torneo que en algunos equipos nuevos no se entendi&oacute; bien, este s&aacute;bado RETOMAMOS el Torneo Primavera 2015 que aun no termino del a&ntilde;o pasado, la zona C juegan hasta la fecha 11 (zona de 12 equipos) y las zonas A y B juegan hasta la fecha 13 (zonas de 14 equipos). Una vez finalizado, comienza el Apertura 2016. Los equipos nuevos que entran ahora ya entran para asegurarse el lugar al Apertura 2016 y la inscripci&oacute;n que est&aacute;n abonando es para el Apertura 2016.</p>\n', b'1'),
(18, 'ESTADISTICAS ACTUALIZADAS / NOS VEMOS EL 2 DE ABRIL', '2016-03-19 00:00:00', '<p>JUGADORES EL SABADO AL JUGADOR <span style="color:#FF0000">OMAR MORALES</span> SE LE EXTRAVIO LA MOCHILA CON TODOS SUS DOCUMENTOS, JUGO EN LA<span style="color:#FF0000"> CANCHA 3 A LAS 16.30HS</span>. SI ALGUIEN LOS VIO POR FAVOR COMUNICARSE CON LA ORGANIZACION PARA DEVOLVERLOS. INFORMAMOS ADEMAS QUE TODAS LAS FECHAS SE ENCUENTRAN LLAVES O DOCUMENTOS QUE LA GENTE ENCUENTRA TIRADOS Y DEJA EN EL BUFFET, CUALQUIER COSA QUE PIERDAN O ENCUENTREN LAS PUEDEN IR A BUSCAR O DEJAR EN EL BUFFET.</p>\r\n\r\n<p>Jugadores les informamos que en semana santa NO habra actividad ningun dia. Vamos a aprovechar el parate para mejorar las canchas, rellenar algunas areas y emparejar tanto las canchas de 11 como las de 7 que en la jornada de hoy se vieron bastante castigadas por la lluvia.</p>\r\n\r\n<p>Estamos muy contentos de informar que compramos dos maquinas nuevas para las canchas que seran entregadas el lunes y ya comenzaran a trabajar, una aireadora sacabocados y una aireadora slicer similares&nbsp;a las que utilizan en el futbol profesional, en la semana subiremos fotos. La idea es sumarlas al mantenimiento y hacer en este parate tambien un arenado de las canchas y fertilizacion. Como dijimos los trabajos que vamos a comenzar a hacer se van a ir viendo a largo plazo, siempre&nbsp;llevan tiempo&nbsp;a las canchas mas cuando recien comenzamos a trabajar con este tipo de maquinas. De a poco vamos a ir cambiando el suelo de las mismas.</p>\r\n\r\n<p>Se expulso al DT del equipo Merengue por intento agresion al juez. Los equipos Defensores y Solo Futbol tienen la primer advertencia por la gente que tienen afuera de la cancha&nbsp;por protestas e insultos en el partido entorpeciendo el desarrollo del mismo, a la 2da advertencia se les prohibira el ingreso de hinchadas y a la 3er advertencia queda el equipo expluido del predio. Lo mismo va para todos los equipos que ocasionen lo mismo.</p>\r\n\r\n<p>Se expulso al equipo Deportivo La Casa por faltar a su partido sin previo aviso. Sera reemplazado por equipo en espera.</p>\r\n\r\n<p>La proxima fecha del 2 de Abril la cargaremos en el transcurso de la semana.</p>\r\n\r\n<p>Que pasen un lindo fin de semana en familia. Saludos!</p>\r\n', b'0'),
(15, 'HORARIOS Y ESTADISTICAS ACTUALIZADAS', '2016-03-14 00:00:00', '<p><span style="color:#FF0000">/// HORARIOS ///</span></p>\r\n\r\n<p><span style="color:#000000">Jugadores, para ver los horarios deben entrar a &quot;Torneos&quot; elegir tu torneo, tu zona y te aparecera el cuadro de &quot;PROXIMA FECHA&quot; al lado de las estadisticas.&nbsp;Cualquier consulta pregunten por favor hasta que se acostumbren a esta manera. Pedimos disculpas si no pudimos complacer a algun equipo con el horario. Como dijimos tratamos de poner los horarios que menos les conviene en las primeras fechas.</span></p>\r\n\r\n<p><span style="color:#000000">La zona C &nbsp;en FUTBOL 7 seguira ahora con 2 sabados de amistosos esperando que terminen la zonas A y B, los equipos que quieran jugar tienen tiempo hasta el martes a la noche para confirmar asistencia, el miercoles se cargaran los horarios.</span></p>\r\n\r\n<p><span style="color:#000000">/// MEJORAS ///</span></p>\r\n\r\n<p><a href="https://www.facebook.com/hashtag/adidas?source=feed_text&amp;story_id=1765141173714760"><span style="color:#000000">#&lrm;adidas</span></a><span style="color:#000000">&nbsp;</span><a href="https://www.facebook.com/hashtag/argentum?source=feed_text&amp;story_id=1765141173714760"><span style="color:#000000">#&lrm;argentum</span></a><span style="color:#000000">&nbsp;y la nueva #adidas&nbsp;</span><a href="https://www.facebook.com/hashtag/conecxt15?source=feed_text&amp;story_id=1765141173714760"><span style="color:#000000">#&lrm;conecxt15</span></a><span style="color:#000000">&nbsp;pelota del mundial de clubes 2015, nuestras bochas, nuevas en TODAS las 8 canchas de F&uacute;tbol 11. Pelotas 100% oficiales de Primera Division. Simplemente LO MEJOR.<br />\r\nCompramos 6 pares de redes nuevos en F&uacute;tbol 11 y arreglamos todos los de F&uacute;tbol 7.<br />\r\nSe arreglaron todos los para-pelotas que hay detr&aacute;s de TODOS los arcos del predio, tanto para F&uacute;tbol 11 como 7. Como habran visto hoy se separo la zona de estacionamiento con la de las canchas y se hicieron dos estacionamientos de motos para que los nenes y las familias puedan andar por las zonas marcadas sin problema lejos del peligro de las motos, logrando de esta manera seguir manteniendo el ambiente familiar en el predio.</span></p>\r\n\r\n<p><span style="color:#000000">/// NOTICIAS FUTBOL 11 ///</span></p>\r\n\r\n<p><span style="color:#000000">Atento equipo Nueva Chicago con la gente que traen a ver el partido, tienen la primer advertencia por protestas e insultos en el partido entorpeciendo el desarrollo del mismo, a la 2da advertencia se les prohibira el ingreso de hinchadas y a la 3er advertencia queda el equipo expluido del predio. Lo mismo va para todos los equipos que ocasionen lo mismo.</span></p>\r\n\r\n<p><span style="color:#000000">/// NOTICIAS FUTBOL 7 ///</span></p>\r\n\r\n<p><span style="color:#000000">Felicitamos al equipo Ataque y Justicia CAMPEONES de la Zona C. Tambien a La 95 F7 por conseguir el 2do puesto y a Seven Night por completar el podio con el 3er puesto y el ascenso a la B.</span></p>\r\n\r\n<p><span style="color:#000000">La zona C seguira ahora con 2 sabados de amistosos esperando que terminen la zonas A y B, los equipos que quieran jugar tienen tiempo hasta el martes a la noche para confirmar asistencia, el miercoles se cargaran los horarios.</span></p>\r\n\r\n<p><span style="color:#000000">Se expulso al equipo Senior SL por faltar a su partido sin previo aviso. Sera reemplazado por equipo en espera.</span></p>\r\n', b'1'),
(14, 'ESTADISTICAS ACTUALIZADAS, HORARIOS Y ESTRENO WEB NUEVA !!!', '2016-03-05 00:00:00', '<p>Web nueva !!! Jugadores, en la pesta&ntilde;a &quot;torneos&quot; podras encontrar tu torneo, zonas, estadisticas, fixture y cliqueando en tu equipo en la tabla de posiciones podes acceder a la planilla personal de cada equipo con el historial y estadisticas del equipo en el predio. Ademas, podes ver el historial de los torneos jugados desde el Apertura 2015 en adelante.</p>\r\n\r\n<p>Esperamos que les guste !!!</p>\r\n\r\n<p>Se expulsaron los equipos de Sporting LP, Zerro y Paso a Paso por no poder completar la minima de jugadores para comenzar el partido. Seran reemplazados por equipos en espera. En la semana definimos que hacemos con No Completan.</p>\r\n\r\n<p>Queremos agradecer a todos por una primer jornada de a&ntilde;o excelente, muy tranquila obviando obviamente las situaciones normales de un partido pero todo se desarrollo con mucha tranquilidad y normalidad.</p>\r\n\r\n<p>Que tengan buena semana. Muchas gracias!</p>\r\n\r\n<p>/// HORARIOS ///</p>\r\n\r\n<p>Perdon si no pudimos complacer a algun equipo con el horario, la idea es en estas primeras 4, 5 fechas de Futbol 11 poner los horarios que menos les conviene a los equipos para que sobre la recta&nbsp;final del torneo en lineas generales&nbsp;tengan los mejores horarios.</p>\r\n\r\n<p>Ya se actualizo el fair play y algunos suspendidos en el torneo con offside.</p>\r\n', b'1'),
(19, 'HORARIOS SABADO 9 DE ABRIL CARGADOS', '2016-03-28 00:00:00', '<p><span style="font-size:20px">Jugadores:</span></p>\r\n\r\n<p><span style="font-size:20px">FUTBOL 11: Si&nbsp;se juega. Fecha confirmada.</span></p>\r\n\r\n<p><span style="font-size:20px">FUTBOL 7: Suspendido. Se pasa todo igual al proximo sabado.</span></p>\r\n\r\n<p><span style="font-size:20px">En estas 2 semanas parados se hizo aireado en todas las canchas y arenado en sectores especificos de las canchas 2, 3, 4, 5, 7,&nbsp;8,&nbsp;6a y 6b con las maquinas nuevas que compramos, si bien esteticamente no se van a ver muy bien en esos sectores aislados es necesario para que absorba la humedad de las lluvias de los ultimos dias&nbsp;y les va a venir muy bien a las canchas, estamos cambiando el suelo de a poco para hacerlo mas arenoso, todo este trabajo&nbsp;recomendado por dos&nbsp;agronomos de los dos clubes mas grandes de nuestra ciudad.</span></p>\r\n\r\n<p><span style="font-size:20px">Nos vemos ma&ntilde;ana sabado.&nbsp;Muchas gracias.</span></p>\r\n\r\n<p>/// FUTBOL 7 AMISTOSOS ZONA C ///</p>\r\n\r\n<p>HS: EQUIPO VS EQUIPO&nbsp;/ CANCHA</p>\r\n\r\n<p>12: AMIGOS vs&nbsp;ROJA DIRECTA / 1A</p>\r\n\r\n<p>12: EL OCULTO vs DE RABONA / 6B</p>\r\n\r\n<p>14.20: LA PLATA F.C vs F.C OSP / 1B</p>\r\n\r\n<p>15.30: DEPORTIVO INCLUSION vs LA RABONA / 1B</p>\r\n\r\n<p>15.30: MARADONA vs FUTBOL ASADO Y VINO / 6B</p>\r\n\r\n<p>16.40: TRIPLE FRONTERA vs&nbsp;DE POTRERO / 6B</p>\r\n\r\n<p>Jugadores, ya pueden ver los horarios de este sabado 2 de Abril.<br />\r\nDeben entrar a &quot;Torneos&quot; elegir tu torneo, tu zona y en las estadisticas te aparecera el cuadro &quot;proxima fecha&quot;.<br />\r\nPor favor confirmar la asistencia por mensaje.</p>\r\n\r\n<p>En la zona B sin off-side el equipo San Jose cambio el nombre a La Banda (sigue siendo el mismo equipo).<br />\r\nEn la zona C con off-side entro el equipo Parque San Martin que vuelve a jugar al predio en reemplazo de Deportivo La Casa.<br />\r\nEn la zona B del torneo de F&uacute;tbol 7 el equipo El Carmen dejo el torneo por temas laborales y es reemplazado por el equipo A.C Milagros y en la zona A entro el equipo De Parado en reemplazo de Ayacucho que se los dio de baja por faltar dos veces al torneo. (con previo aviso ambas pero faltaron 2 veces al final).</p>\r\n\r\n<p>Los equipos de F&uacute;tbol 7 ZONA C que quieran jugar amistoso este s&aacute;bado por favor confirmar asistencia antes de ma&ntilde;ana martes a la noche.</p>\r\n\r\n<p>Hasta el sabado. Saludos!</p>\r\n', b'0'),
(20, 'CERO TOLERANCIA / HORARIOS SABADO 23', '2016-04-09 00:00:00', '<p>Jugadores siendo las 9.30 la jornada se juega normal en su totalidad con las inclemencias propias del clima. Cualquier cosa estremos publicando inmediatamente.</p>\r\n\r\n<p>Nos vemos en breve !</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/// FUTBOL 7 - AMISTOSOS ZONA C ///</p>\r\n\r\n<p>12hs: DE RABONA - ROJA DIRECTA / Cancha 1A</p>\r\n\r\n<p>14.20: LA PLATA F.C - EL OCULTO / Cancha 1B</p>\r\n\r\n<p>15.30: DEPORTIVO INCLUSION - FC OSP / Cancha 1B</p>\r\n\r\n<p>15.30: EL BORUSSIA - LA RABONA / Cancha 6B</p>\r\n\r\n<p>16.40: TRIPLE FRONTERA - DE POTRERO / Cancha 6B</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>/// FUTBOL 11 ///</p>\r\n\r\n<p>Ya podes ver en las &quot;Estadisticas&quot; de tu zona los HORARIOS del proximo sabado 23&nbsp;y algunas estadisticas que faltaban actualizarse.</p>\r\n\r\n<p>Entran los equipos SANTOS en reemplazo de Red Bull, LA RAMBLA en reemplazo de Guerreros Z y FUTBOL, ASADO Y VINO en reemplazo de Merengues.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En el dia de la fecha (sabado 9)&nbsp;se decidio expulsar a los equipos Merengue y Guerreros Z por una verguenza de final de partido entre los dos equipos empa&ntilde;ando lo excelente que estuvo el resto de la jornada y el ambiente general del predio.</p>\r\n\r\n<p>Se expulso al equipo Red Bull por faltar a jugar su partido sin previo aviso.</p>\r\n\r\n<p>Se le descontara un punto al finalizar el torneo al equipo Los Apostoles por comenzar el partido pasados los 10min. de demora.</p>\r\n\r\n<p>Los 3 equipos seran reemplazados por equipos en espera.</p>\r\n\r\n<p>Los horarios del proximo sabado estaran el dia lunes.</p>\r\n\r\n<p>Muchas gracias a todos por una excelente jornada en lineas generales. Hasta el proximo sabado.</p>\r\n', b'1'),
(21, 'ESTADISTICAS ACTUALIZADAS SABADO 23', '2016-04-23 00:00:00', '<p><span style="color:#000000">/// FUTBOL 11 ///</span></p>\r\n\r\n<p><span style="color:#FF0000">HORARIOS:</span>&nbsp;<span style="color:#000000">Ya pueden ver en la zona de estadisticas los horarios del proximo sabado 30 por la fecha n&deg;6. Recordamos por las dudas que el torneo es ida y&nbsp;vuelta: 18 fechas en total.</span></p>\r\n\r\n<p><span style="color:#000000">ABONO INSCRIPCION:&nbsp;Se tendra como ULTIMO PLAZO la FECHA 7, pasada esa fecha NO SE SUMARAN &acute;PUNTOS a los equipos hasta no completar la misma. El torneo comenzo hace dos meses, ya no hay excusas para no abonar la misma, saben la mayoria que somos muy tolerantes con el tema economico,&nbsp;algunos equipos algunas fechas no llegan a pagar el total del partido y los dejamos a deuda, lo mismo con la inscripcion y otras cosas mas que les hacemos &quot;el favor&quot;, pero ya a dos meses de haber comenzado y no completarla es un abuso de confianza hacia la organizacion. Pueden preguntar por mensaje la deuda de cada uno.</span></p>\r\n\r\n<p><span style="color:#000000">/// FUTBOL 7 ///</span></p>\r\n\r\n<p><span style="color:#FF0000">HORARIOS:</span>&nbsp;<span style="color:#000000">Ya pueden ver en la zona de estadisticas los horarios de este&nbsp;sabado 30 por la primer fecha del Torneo Apertura 2016 junto con las zonas definidas. Disculpen la demora, los horarios luego se cargaran como siempre los dias lunes.&nbsp;Los premios se entregaran este sabado en el buffet a cada equipo luego de su partido.</span></p>\r\n\r\n<p><span style="color:#000000">FELICITACIONES MACHETE Y PLATENSES !!! Ambos ganadores de las Zonas A y B respectivamente. Felicitamos ademas a los equipos El Matador y 28 de Febrero quienes&nbsp;disputaron otras finales con una muy buena conducta destacada y ejemplar teniendo en cuenta estas instancias finales.</span></p>\r\n\r\n<p><span style="color:#000000">Los podios:</span></p>\r\n\r\n<p><span style="color:#000000">ZONA A:&nbsp;Campeon: Machete F.C / 2do puesto: El Matador / 3er puesto: Villa Alba / Goleador: Lerda Matias de Barrio Hipodromo / Valla menos vencida: Machete F.C</span></p>\r\n\r\n<p><span style="color:#000000">ZONA B: Campeon: Platenses / 2do puesto: 28 de Febrero / 3er puesto: Los Pibes F.C / Goleador: Norona Roberto de 28 de Febrero / Valla menos vencida: Los Pibes F.C</span></p>\r\n\r\n<p><span style="color:#000000">ZONA C: Campeon: Ataque y Justicia&nbsp;/ 2do puesto: La 95 / 3er puesto: Seven Night / Goleador: Lescano Fabio de La 95 / Valla menos vencida: Ataque y Justicia</span></p>\r\n\r\n<p><span style="color:#000000">PODIOS GENERALES: Fair Play: Los Pibes F.C con solo 4pts, se ganan la inscripcion gratis al proximo torneo&nbsp;/ Goleador del torneo: Norona Roberto con 21 goles, se gana el par de botines&nbsp;/ Valla menos vencida: Los Pibes F.C con 7&nbsp;goles se ganan el par de guantes de arquero.</span></p>\r\n\r\n<p><span style="color:#000000">ABONO INSCRIPCION:&nbsp;Se tendra como ULTIMO PLAZO la FECHA 3 para abonar la inscripcion, pasada esa fecha se comenzara a cobrar una multa extra por cada fecha que no se complete hasta tomar las mismas medidas que en futbol 11.</span></p>\r\n\r\n<p><span style="color:#000000">HORARIOS TORNEO APERTURA 2016: El dia martes o miercoles se cargaron los horarios del proximo sabado junto con las zonas definidas ya que algunos equipos nuevos&nbsp;entraron en estas ultimas fechas y seran re-acomodados. Se expulsaron los equipos Los Duros y Mandiyu por faltar a su partido sin previo aviso.&nbsp;Seran reemplazados por equipos en lista de espera.</span></p>\r\n', b'1'),
(23, 'ESTADISTICAS SABADO 30 ACTUALIZADAS JUNTO CON HORARIOS / CERO TOLERANCIA', '2016-04-30 00:00:00', '<p><span style="color:#000000">IMPORTANTE</span></p>\r\n\r\n<p><span style="color:#000000">- Seguimos con el camino de </span><span style="color:#FF0000">CERO TOLERANCIA</span><span style="color:#000000">: Este sabado se expulsaron varios jugadores de distintos equipos, se prohibieron espectadores&nbsp;y a otros tantos se les dio gran cantidad de fechas de sancion. Notamos que algunos jugadores y equipos estan viniendo a jugar alterados, a los gritos&nbsp;con los arbitros, los rivales, el personal, olvidandose que tras eso corren sanciones y que el unico fin del predio es que vengan a divertirse y distenderse de la rutina semanal, no tiene sentido venir a amargarse por un partido de futbol que en difinitiva no ganas nada, un juego de camisetas y un trofeo no le cambia la vida a nadie. Estos equipos van a ser advertidos y de no cambiar la conducta los tendremos que dar de baja del torneo.</span></p>\r\n\r\n<p><span style="color:#000000">- No olviden por favor de comunicarse con la organizacion&nbsp;para informar cualquier cosa que no les guste y vean que se puede mejorar ya sea arbitros, personal, conducta de los rivales (esto es muy importante, si ven que un equipo rival viene de &quot;mala leche&quot; y no con buena predisposicion hacernoslo saber para hablar con ese equipo y que se adapten al predio). Estamos abiertos al dialogo.</span></p>\r\n\r\n<p><span style="color:#000000">- A partir de este sabado se implementaran dos medidas: *Jugador que tenga 3 fechas de suspension o mas tiene PROHIBIDA la entrada al predio. De hacerlo el equipo&nbsp;perdera los puntos en juego. *Todos los suplentes, DT y amigos de los equipos deberan ubicarse ATRAS de los arcos. No se permitira a nadie en los laterales de todas las canchas.</span></p>\r\n\r\n<p><span style="color:#000000">- Los equipos Parque Castelli y Barrio UPCN tienen prohibido el ingreso de espectadores al predio. Solo podran estar los 11 jugadores y los 5 suplentes.</span></p>\r\n\r\n<p><span style="color:#000000">- FUTBOL 11: Se extendera la sancion por&nbsp;acumulacion de amarillas de 3 a 4 amarillas debido al pedido de muchos equipos&nbsp;al ser un torneo tan largo (18 fechas). Los jugadores que actualmente figuran suspendidos por acumulacion de 3 amarillas estan HABILITADOS para el sabado. En la semana se re-programara la web para cambiarlo ya que el sistema lo carga automatico. En FUTBOL 7 sigue igual, 3 amarillas.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000">Muchas gracias por entender lo que buscamos en el predio. Si sentis que sos parte y buscas lo mismo&nbsp;cuidalo, un mejor torneo lo hacemos entre todos.</span></p>\r\n\r\n<p><span style="color:#000000">Hasta el sabado!</span></p>\r\n', b'1'),
(24, 'ESTASDISTICAS SABADO 7/5 ACTUALIZADAS Y HORARIOS SABADO 14/5 CARGADOS', '2016-05-07 00:00:00', '<p>/// HORARIOS CARGADOS ///</p>\r\n\r\n<p>-Ya podes ver en la zona de estadisticas los horarios del proximo sabado y algunas estadisticas e informes corregidos.</p>\r\n\r\n<p>-Los suspendidos por acumulacion de amarillas y amarillas en futbol 11 no estan actualizados, se actualizaran en la semana debido a la nueva configuracion del sistema de la web que se tiene que terminar. (no es facil y lleva tiempo ya que responde automaticamente a las 7 fechas ya cargadas).</p>\r\n\r\n<p>-Se ve que las medidas tomadas&nbsp;dieron su fruto ya que se vivio&nbsp;una jornada impecable.</p>\r\n\r\n<p>-En la semana en Futbol 11 vuelvan a chequear los suspendidos por acumulacion por 4 amarillas ya que aun no se programo la web. Futbol 7 recuerden que sigue igual con 3 amarillas.</p>\r\n\r\n<p>Hasta el sabado.&nbsp;Muchas gracias.</p>\r\n', b'1'),
(28, 'ESTADISTICAS SABADO 21/5 Y HORARIOS MIERCOLES 25/5 ACTUALIZADOS', '2016-05-22 00:00:00', '<p>/// HORARIOS MIERCOLES 25/5&nbsp;CARGADOS /// Los podes ver en la zona de estadisticas.</p>\r\n\r\n<p>/// FUTBOL 11 /// SUSPENDIDOS POR ACUMULACION DE 4 AMARILLAS PARA LA FECHA 10:</p>\r\n\r\n<p>Jimenez Abel y Jimenez Martin, Catalama / Jaime Martin, Branca Leverkusen / Parma Agustin, El Cervecero / Pietrosanti Lucas, Defensores / Salazar Miguel, El Rejunte,</p>\r\n\r\n<p>- Ahora que arranca el fr&iacute;o queremos recordarte que hace unos meses inauguramos los vestuarios con duchas calientes.<br />\r\nJugas, sal&iacute;s y te ba&ntilde;as! Esperemos que les gusten! Muchas gracias a vos que con tu aporte logras que sigamos invirtiendo y creciendo en el Predio para brindarte mas y mejores servicios.</p>\r\n\r\n<p>- Por cualquier error por favor comunicarse para arreglarlo.</p>\r\n\r\n<p>- Se le prohibe el ingreso de visitantes al equipo Triple Frontera.</p>\r\n\r\n<p>- Ma&ntilde;ana lunes se cargaran los jugadores que tienen una fecha de suspension por acumulacion de 4 amarillas en Futbol 11.</p>\r\n\r\n<p>Hasta el miercoles!</p>\r\n', b'1'),
(29, 'ESTADISTICAS MIERCOLES 25/5 Y HORARIOS SABADO 28/5 ACTUALIZADOS', '2016-05-26 00:00:00', '<p><span style="line-height:1.6">Jugadores por el momento la jornada de ma&ntilde;ana s&aacute;bado esta CONFIRMADA.</span></p>\r\n\r\n<p>Cualquier novedad estaremos publicando.<br />\r\nEsperemos el clima ayude.</p>\r\n\r\n<p><span style="color:#000000">/// HORARIOS SABADO 28 CARGADOS /// Los podes ver en las estadisticas.</span></p>\r\n\r\n<p><span style="color:#000000">- Se le descontara 1 punto al finalizar el torneo a los equipos Los Apostoles (2da vez) y a U.87 por comenzar el partido pasados los 10min. de demora.</span></p>\r\n\r\n<p><span style="color:#000000">- Se expulsa a un jugador de La 92 por agresion al juez. Al equipo se le descontaran&nbsp;3pts al finalizar el torneo. Si bien el equipo tuvo una excelente conducta debe hacerse reponsable del invitado. Correran las mismas sanciones en casos aislados de agresion grave entre rivales.</span></p>\r\n\r\n<p><span style="color:#000000">- // FUTBOL 11 /// ATENCION EQUIPOS:&nbsp;Barrio UPCN, Parque Castelli, West Jamon, Branca Leverkusen, El Palomar, Almafuerte, Solo Futbol.</span></p>\r\n\r\n<p><span style="color:#000000">Ya pasaron mas de la mitad de pts en la tabla de Fair Play (buena conducta) quedando mitad de torneo por jugarse. A los 60pts queda el equipo EXCLUIDO del torneo. Ni ustedes ni nosotros queremos llegar a eso, cuidado con la conducta !</span></p>\r\n\r\n<p><span style="color:#000000">- El equipo CDC se retira del torneo por no estar de acuerdo con las altas sanciones dadas a ellos por la organizacion (sumado a que estaban con 58pts de Fair Play). El equipo Dep. Nubarron se retira del torneo por no completar equipo. Seran reemplazados por equipos en espera.</span></p>\r\n\r\n<p><span style="color:#000000">- Pedimos disculpas si no pudimos complacer a algun equipo con los horarios, se va a repetir en lineas generales la primer ronda.</span></p>\r\n\r\n<p><span style="color:#000000">- El jugador Leo Moreira de All Boys regala un par de Botines talle 43 para el jugador que REALMENTE los necesite. Comunicarse con la organizacion para que los entreguemos. Se agredece y felicita enormemente el buen gesto del jugador y del equipo.</span></p>\r\n\r\n<p><span style="color:#000000">Muchas gracias por tu compromiso con el predio el dia miercoles donde concurrieron 97 equipos al ser un feriado nacional y por una excelente jornada en lineas generales.</span></p>\r\n\r\n<p><span style="color:#000000">Hasta el sabado!</span></p>\r\n', b'1'),
(27, 'ESTADISTICAS SABADO 14/5 Y HORARIOS SABADO 21/5 ACTUALIZADOS', '2016-05-15 00:00:00', '<p>/// HORARIOS SABADO 21/5 CARGADOS /// Pedimos disculpas si no pudimos complacer a algunos equipos con los horarios.</p>\r\n\r\n<p>- Por cualquier error por favor comunicarse para arreglarlo.</p>\r\n\r\n<p>- Se les da la primer advertencia a los equipos El Cervecero, BH, Fc.84, y Deportivo Branca por el feo comportamiento e imagen que dejaron el sabado pasado. A la 2da vez no habra advertencia sino la exclusion del torneo. A mejorar !</p>\r\n\r\n<p>- Se le descontara un punto a los equipos Deportivo Caravana y Liverpool al finalizar el torneo por comenzar el partido pasados los 10min. de demora. Otros equipos llegaron muy sobre la hora, se seguiran sacando pts de ser necesario para mantener la puntualidad en el predio. Recuerden que los horarios publicados son de comienzo del partido y no de llegada al predio.</p>\r\n\r\n<p>- Se expulsaron 3 jugadores de diversos equipos por agresion a los rivales.</p>\r\n\r\n<p>- Se expulsa al equipo Deportivo Inclusion por faltar a su partido sin previo aviso. Sera reemplazado por equipo en lista de espera.</p>\r\n\r\n<p>- Los siguientes jugadores en Futbol 11 tienen una fecha de suspension por acumulacion de 4 amarillas. En las estadisticas ahora no figuran, se cargaran en la semana.</p>\r\n\r\n<p>Larraz Javier, Los Apostoles / Bastia Nicolas, CDC / Moreno Gabriel, Union V.E / Camiletti Franco y Presutti Sergio, Almafuerte /&nbsp;Franco David, CB</p>\r\n\r\n<p>-&nbsp;Los horarios del sabado 21/5 estaran cargados el dia lunes a la noche o martes a la ma&ntilde;ana a mas tardar.</p>\r\n\r\n<p>- INFORMAMOS QUE EL MIERCOLES 25 DE MAYO FERIADO NACIONAL SE DESARROLLARA FECHA NORMAL</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Muchas gracias. Que tengan una buena semana !</p>\r\n', b'1'),
(30, 'ESTADISTICAS SABADO 28/5 Y HORARIOS SABADO 11/6 ACTUALIZADOS', '2016-05-28 00:00:00', '<p><span style="color:#000000">/// FECHA SUSPENDIDA POR LLUVIA ///</span></p>\r\n\r\n<p><span style="color:#000000">Estimado jugador, buen d&iacute;a.</span></p>\r\n\r\n<p><span style="color:#000000">Siendo las 8.50hs la jornada se suspende por lluvia que ya comenz&oacute; a caer en el predio. Sumado a que todos los pron&oacute;sticos indican que seguir&aacute; as&iacute;. Preferimos avisarte con tiempo para que&nbsp;organices tu&nbsp;tarde.</span></p>\r\n\r\n<p><span style="color:#000000">Te deseamos un buen fin de semana.</span></p>\r\n\r\n<p><span style="color:#000000">Hasta el pr&oacute;ximo s&aacute;bado respetando cancha, horario y rival.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000">/// HORARIOS S&Aacute;BADO 11/6 ///&nbsp;Ya podes ver en la zona de estadisticas&nbsp;los horarios de la pr&oacute;xima fecha a jugarse este S&aacute;bado 11&nbsp;de Junio.</span></p>\r\n\r\n<p><span style="color:#000000">- Se recuerda a todos los equipos que el tiempo limite para avisar de la no concurrencia a&nbsp;alguna fecha es hasta el dia jueves inclusive. Avisando a partir del dia viernes deberan abonar multa economica para continuar en el torneo. A las 2 faltas al torneo el equipo queda EXCLUIDO. Son temas ya hablados y que figuran en el reglamento.</span></p>\r\n\r\n<p><span style="color:#000000">- Se le da por perdido el partido de la fecha 9 a Etiqueta Negra ( Futbol 11) por haber introducido un jugador suspendido con otro Dni. Parte de la Organizacion lo pudo reconocer en la fecha de hoy y se procedio a aplicar el reglamento. Dicho jugador suma otra sancion.</span></p>\r\n\r\n<p><span style="color:#000000">- Se le da por perdido el partido al equipo Deportivo Caravana ( Futbol 7 ) por haber recibido la expulsion de 3 jugadores en el partido quedando con 4 jugadores en cancha y no llegar al limite de 5 jugadores para seguir el encuentro.</span></p>\r\n\r\n<p><span style="color:#000000">- Los horarios estaran cargados el dia Lunes a la noche.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000">Te deseamos una buena semana. Hasta el proximo sabado !</span></p>\r\n', b'1'),
(34, 'ESTADISTICAS SABADO 11/6 Y HORARIOS SABADO 18 ACTUALIZADOS', '2016-06-11 00:00:00', '<p><span style="color:#000000">/// RECORDAMOS QUE EL PROXIMO FIN DE SEMANA SE JUGARA SABADO 18 Y LUNES 20 ///</span></p>\r\n\r\n<p><span style="color:#000000">- Ya podes ver los horarios del dia sabado 18. El viernes publicaremos los horarios del LUNES 20.</span></p>\r\n\r\n<p><span style="color:#000000">Si algun equipo no se va a poder presentar a alguno de los dos dias por favor avisar antes del JUEVES&nbsp;a la noche y no correra ninguna sancion por ser fin de semana largo. Avisando el dia VIERNES o posterior ya correran las sanciones ya mensionadas. (multa economica + una falta + 10pts de fair play).</span></p>\r\n\r\n<p><span style="color:#000000">- Ya podes ver en tu torneo todas las estadisticas. Por cualquier error de tipeo enviar un mensaje para arreglarlo.</span></p>\r\n\r\n<p><span style="color:#000000">- Se expulsaron un jugador de Vamos de Vuelta, Mas o Menos y CB por agresion a rival, amenaza a la organizacion y amenaza al juez respectivamente. Cualquiera de estos 3 jugadores de ingresar al predio el equipo perdera la vacante automaticamente. Al equipo Vamos de Vuelta se le descontaran 3pts al finalizar el torneo por la agresion de su jugador.</span></p>\r\n\r\n<p><span style="color:#000000">- Se le descontara 1pt al finalizar el torneo al equipo Los Desconocidos por comenzar el partido pasado los 10min. de demora.</span></p>\r\n\r\n<p><span style="color:#000000">Muchas gracias! Que tengas una buena semana!</span></p>\r\n', b'1'),
(35, 'ESTADISTICAS SABADO 18 Y HORARIOS LUNES 20 ACTUALIZADOS', '2016-06-18 00:00:00', '<p>- Ya podes ver los horarios del dia LUNES 20 y las estadisticas de la fecha del dia de hoy. Por cualquier error enviar mensaje para arreglarlo.</p>\r\n\r\n<p>-Se perdi&oacute; un bolso en la cancha 4 a las 16.30hs con documentos importantes y la llave de un auto. Si alguien lo tom&oacute; por error por favor dejarlo el lunes en el buffet, es de mucha importancia.</p>\r\n\r\n<p>Nos vemos el dia lunes. Saludos!!</p>\r\n', b'1'),
(36, 'ESTADISTICAS LUNES 20 Y HORARIOS SABADO 25 ACTUALIZADOS / CERO TOLERANCIA', '2016-06-20 00:00:00', '<p><strong>La jornada de hoy por el momento se desarrolla con normalidad. Cualquier cosa publicamos.<br />\r\nLes deseamos una buena jornada.<br />\r\nNos vemos en breve&nbsp;</strong></p>\r\n\r\n<p><strong><span style="color:#000000">Ya podes ver en la zona de estadisticas los horarios del proximo sabado 25. Saludos!</span></strong></p>\r\n\r\n<p><strong><span style="color:#FF0000">- CERO TOLERANCIA</span>:</strong><span style="color:#000000"> Lamentamos informar que se expulsaron los equipos Adestiempo y William Boo por agresion entre ellos en la cancha 8 a las 16.30hs. Lamentamos la expulsion de ambos equipos, sabemos que son buena gente pero por un momento de calentura de algunos jugadores tiene que responder el equipo, como siempre, CONTROLAR LOS JUGADORES, los equipos se hacen responsables de sus jugadores sean invitados o no.&nbsp;Recordamos que tenemos el<strong> </strong></span><strong><span style="color:#FF0000">&quot;derecho de admision&quot;</span>&nbsp;</strong><span style="color:#000000">y si algun equipo o jugador&nbsp;no se comporta de manera educada y controlada dentro de la cancha y el predio como lo buscamos nosotros sera&nbsp;excluido, no queremos perder el gran ambiente que tanto nos costo armar por algunos que no saben comportarse.</span></p>\r\n\r\n<p><span style="color:#000000">- Recordamos que en Futbol 11 el limite de Fair Play es de 60pts y en Futbol 7 es de 40pts. Superado este limite el equipo queda excluido del torneo.&nbsp;Muchos equipos ya estan en los 50pts en F11 y 30pts en F7 restando 4 fechas por jugarse.</span></p>\r\n\r\n<p><span style="color:#000000">- Se le descontara 1 punto al finalizar el torneo al equipo Branca Leverkusen por comenzar el partido con 10min. de demora. (Sancion correspondiente del dia sabado).</span></p>\r\n\r\n<p><span style="color:#000000">- Por cualquier error en las estadisticas enviar un mensaje para corregirlo. Se recuerda que las mismas no se actualizan sino hasta el momento que se lo informa por este inicio.</span></p>\r\n\r\n<p><span style="color:#000000">- Los horarios estaran el dia martes por la noche.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000">Muchas gracias. Hasta el sabado !</span></p>\r\n', b'1'),
(33, 'Te esperamos este sabado 11', '2016-06-08 00:00:00', '<p>LA FECHA DE MA&Ntilde;ANA SABADO 11 ESTA CONFIRMADA</p>\r\n\r\n<p><span style="color:#000000">Estimados jugadores!<br />\r\nArgentina gan&oacute; en el debut de la Copa Am&eacute;rica y encima el clima parece que ayuda con un lindo sol para este s&aacute;bado, as&iacute; que todo en orden !!!</span></p>\r\n\r\n<p><span style="color:#000000">Les recordamos que el lunes 20 de este mes FERIADO NACIONAL habra&nbsp;fecha normal. Jugandose ese fin de semana sabado 18 y lunes 20.</span></p>\r\n\r\n<p><span style="color:#000000">Te dejamos un compilado de algunas postales de los mas peques, porque ellos tambi&eacute;n son parte de nuestros s&aacute;bados.</span><br />\r\n<a href="https://www.facebook.com/hashtag/predio98?source=feed_text&amp;story_id=1807332062829004"><span style="color:#000000">#&lrm;predio98</span></a><span style="color:#000000">&nbsp;</span><a href="https://www.facebook.com/hashtag/familia?source=feed_text&amp;story_id=1807332062829004"><span style="color:#000000">#&lrm;familia</span></a><span style="color:#000000">&nbsp;</span><a href="https://www.facebook.com/hashtag/amigos?source=feed_text&amp;story_id=1807332062829004"><span style="color:#000000">#&lrm;amigos</span></a><span style="color:#000000">&nbsp;</span><a href="https://www.facebook.com/hashtag/buenaonda?source=feed_text&amp;story_id=1807332062829004"><span style="color:#000000">#&lrm;buenaonda</span></a></p>\r\n\r\n<p><span style="color:#000000">Nos vemos este sabado. Saludos !</span></p>\r\n', b'1'),
(38, 'ESTADISTICAS SABADO 25-6 Y HORARIOS SABADO 6-8 ACTUALIZADOS / IMPORTANTE !!! CAMBIO DE DESARROLLO EN TODOS LOS TORNEOS', '2016-06-25 00:00:00', '<p><span style="color:#000000"><u><strong>Otra vez sopa... como ver&aacute;n en las im&aacute;genes tomadas reci&eacute;n imposible jugar ma&ntilde;ana. Este a&ntilde;o el peor, lejos, desde que tenemos el torneo por el clima, reflej&aacute;ndose en las canchas y en tantas suspensiones. Somos los que m&aacute;s queremos jugar y los primeros perjudicados en suspender por los grandes gastos fijos que tenemos en el predio teni&eacute;ndolo parado. Recordamos que los pr&oacute;ximos s&aacute;bados 23 y 30 el predio permanece cerrado por las vacaciones de invierno. En el predio se seguir&aacute; trabajando todos los d&iacute;as como siempre en las canchas y con grandes remodelaciones en el Buffet y vestuarios para seguir mejorando el servicio que se merecen.</strong></u></span></p>\r\n\r\n<p><br />\r\n<span style="color:#000000"><u><strong>Nos reencontramos el s&aacute;bado 6 de agosto manteniendo todos los fixtures iguales.<br />\r\nUn saludo grande a todos.</strong></u></span></p>\r\n\r\n<p><span style="color:#000000">Ya &nbsp;podes ver en la zona de estad&iacute;sticas todos los horarios del proximo sabado 6/8. Pedimos disculpas a los que no pudimos complacer con los horarios.</span></p>\r\n\r\n<p><span style="color:#000000">Les deseamos una buena semana. Hasta el s&aacute;bado!</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#FF0000"><strong>INSCRIPCIONES CLAUSURA 2016</strong></span></p>\r\n\r\n<p><span style="color:#000000">- Tanto para Futbol 11 como Futbol 7 ya se encuentran abiertas las incripciones para el Clausura 2016 que dara comienzo el sabado </span><span style="color:#FF0000"><strong>13&nbsp;de agosto</strong>.</span><span style="color:#000000"> </span><span style="color:#000000">(El fin de semana del 9 de julio, se jugara fecha SOLAMENTE el sabado 9 de julio, independientemente de que el viernes 8 sea feriado o no).&nbsp;</span></p>\r\n\r\n<p><span style="color:#000000">- Los sabados 23 y 30 de Julio el predio permanecera CERRADO por el parate de invierno, donde aprovecharemos para hacer mejoras en las canchas, emparejamiento, un buen riego y mantenimiento en el predio en gral.</span></p>\r\n\r\n<p><span style="color:#000000">- Para asegurar la vacante al proximo torneo los equipos NO deben tener deudas y abonar la mitad o el total de la inscripcion en estas 3 fechas restantes. SIN EXCEPCIONES. La inscripcion es el mismo valor de un partido, por el momento podemos decir que vamos a mantener los mismos precios haciendo un esfuerzo enorme de todo el personal del predio.</span></p>\r\n\r\n<p><span style="color:#FF0000"><strong>FUTBOL 11 - CAMBIOS IMPORTANTES EN EL DESARROLLO DEL TORNEO</strong></span></p>\r\n\r\n<p><span style="color:#000000">Queremos informas que el Torneo SIN OFF-SIDE dejara de realizarse, donde se hara en todo el predio CON OFF-SIDE a partir del Clausura 2016.&nbsp;Porque este cambio???</span></p>\r\n\r\n<p><span style="color:#000000">- Vamos a agregar la zona D al torneo CON OFF-SIDE. Pasando a ser un unico torneo en las 8 canchas del predio con 64 equipos divididos en 4 zonas de 16 equipos por zona, sera un torneo de unica ronda con 15 fechas.</span></p>\r\n\r\n<p><span style="color:#000000">Cuales son las ventajas???</span></p>\r\n\r\n<p><span style="color:#000000">- Muchisimas, vamos a dejar de cargar el fixture semana a semana y mejorar esta parte organizativa que andaba medio floja, de esta manera&nbsp;las zonas se van a agrupar por horarios: Zonas A y B jugaran en horarios rotativos entre las 15 y 16.30 (un sabado cada uno). Zona C jugara toda la zona en horario fijo a las 13.30 y zona D jugara en horario fijo a las 12. Se mantendra el concepto de 3 ascensos y 3 descensos por zona entre las Zonas A, B y C. La zona D sera una zona aparte de este sistema por la complejidad del horario&nbsp;que es muy limitado para la mayoria de los equipos. Igualmente no se asusten!! Todas las zonas y horarios para acomodar los equipos se pueden hablar, aca la prioridad es venir al predio a jugar, divertirse, hacer un lindo deporte al aire libre con amigos y en mucho casos con la familia, no a competir por una zona o un premio, algo que siempre lo hemos dicho que para nosotros eso es secundario.</span></p>\r\n\r\n<p><span style="color:#000000">- De esta manera, cargaremos el fixture COMPLETO de todo el torneo antes de comenzarlo, sabiendo de la fecha 1 a las 15 el rival, horario, cancha y incluso el arbitro que les tocara.</span></p>\r\n\r\n<p><span style="color:#000000">- Al cargar el fixture completo y el equipo al ingresar a &quot;x&quot; zona con un horario ya asignado&nbsp;seran los horarios JUSTOS para todos.</span></p>\r\n\r\n<p><span style="color:#000000">- Las ternas arbitrales quedaran fijas en una cancha asignada para cada uno en todo el torneo y los equipos iran rotando en ronda de la cancha 1 a la 8, de esta manera, nadie repetira NUNCA cancha ni terna arbitral sino hasta completar la ronda de haber jugado en las 8 canchas, es decir, repetiran cancha y terna recien a las 8 fechas.</span></p>\r\n\r\n<p><span style="color:#000000">- Por favor no mal-interpreten este cambio como algo&nbsp;economico para nosotros como algunos pensaran, sino que es totalmente para mejorar la organizacion,&nbsp;ya que la peque&ntilde;a diferencia que hay en el valor de un torneo a otro es el canon de la terna arbitral. No varia para nosotros un partido con o sin offside.</span></p>\r\n\r\n<p><span style="color:#000000">- Les queremos agradecer a los que sigan con nosotros y esperamos que les guste este nuevo formato donde quedara el torneo 100% mejor organizado.</span></p>\r\n\r\n<p><span style="color:#000000">- Al ser un torneo en transicion de uno con otro se tratara de mantener las categorias altas por el nivel de juego, algunos cambios seguramente se produciran a otras zonas por los horarios, al faltar mas de un mes para el comienzo se podra organizar con tiempo.</span></p>\r\n\r\n<p><span style="color:#000000">- Los equipos actuales tanto con off-side como sin off-side confirmar la presencia a este nuevo torneo esta semana por si o por no por mensaje, para charlar con tiempo cada caso puntual para mantener en los que se pueda tanto la categoria como los horarios. No se duerman !!!</span></p>\r\n\r\n<p><span style="color:#FF0000"><strong>FUTBOL 7&nbsp;- CAMBIOS IMPORTANTES EN EL DESARROLLO DEL TORNEO</strong></span></p>\r\n\r\n<p><span style="color:#000000">- Al igual que en Futbol 11 se realizara cambio en el formato del torneo. Se agregara la Zona D. Seguiran siendo 40 equipos pero divididos en 4 zonas de 10 equipos cada zona jugandose a dos rondas (18 fechas en total).</span></p>\r\n\r\n<p><span style="color:#000000">- Porque el cambio ??? Mismo motivo, para mejorar la parte organizativa ya que en el torneo actual la Zona C quedaba con 2 partidos menos por torneo lo cual dificultaba el desarrollo de esta zona teniendo que esperar 2 fechas para asignarse ascensos y descensos y equipos libres. De esta manera el fixture sera parejo para todos los equipos.</span></p>\r\n\r\n<p><span style="color:#000000">- El fixture se seguira cargando semanalmente como lo veniamos haciendo, ya que por el momento no viene realizando inconvenientes el armado del mismo con los horarios de los equipos.</span></p>\r\n\r\n<p><span style="color:#FF0000"><strong>- FELICITACIONES DEFENSORES Y FC. 84 !!!</strong> </span><span style="color:#000000">Ambos equipos campeones de la zonas B sin off-side y zona C con off-side respectivamente, a 3 fechas de terminar el torneo. FC. 84 en un caso insolito donde los dos equipos que le seguian la punta (BH y El Cervecero) fueron excluidos del torneo por faltar a jugar su partido sin previo aviso. La entrega de premios se hara la primer fecha del Torneo Clausura 2016 ya que las copas metalicas importadas van grabadas con todos los datos del equipo y el torneo.</span></p>\r\n\r\n<p><span style="color:#000000">- Por cualquier error de tipeo enviar un mensaje para corregirlo.</span></p>\r\n\r\n<p><span style="color:#000000">- Se le descontara 1 punto al equipo Catalama por comenzar el partido pasado los 10min. de demora.</span></p>\r\n\r\n<p><span style="color:#000000">- Los horarios estaran el dia lunes por la noche.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000">Como siempre muchas gracias, cualquier consulta, queja, duda o sugerencia estamos mas que disponibles para charlarla y siempre mejorar.</span></p>\r\n\r\n<p><span style="color:#000000">Hasta el proximo sabado. Buena semana!</span></p>\r\n', b'1');
