INSERT INTO `tbcontenidos` (`idcontenido`, `texto`, `refseccion`) VALUES
(1, '<div id="reglamento" class="row" style="margin-top:20px; padding-left:40px; padding-right:40px;" align="center">\r\n                    	<h1>PREDIO 98</h1>\r\n                    	<h3>Desarrollo</h3>\r\n                    </div>\r\n                    <section id="tabs">\r\n                        <input id="tab-1" type="radio" name="radio-set" class="tab-selector-1" checked="checked" />\r\n                        <label for="tab-1" class="tab-label-1" style="width:320px;">Futbol 11 Sin Off-Side</label>\r\n                \r\n                        <input id="tab-2" type="radio" name="radio-set" class="tab-selector-2" />\r\n                        <label for="tab-2" class="tab-label-2" style="width:320px;">Futbol 11 Con Off-Side</label>\r\n                \r\n                        <input id="tab-3" type="radio" name="radio-set" class="tab-selector-3" />\r\n                        <label for="tab-3" class="tab-label-3" style="width:160px;">Futbol 7</label>\r\n                    \r\n                        <div class="clear-shadow"></div>\r\n                    \r\n                        <div class="content3">\r\n                            <div class="content-1">\r\n                                <p>LOS PARTIDOS SE JUGARAN LOS DÃAS SÃBADOS Y FERIADOS EN LOS HORARIOS DE LAS 12, 13.30, 15 Y 16.30.</p>\r\n\r\n                                <p>EN CASO DE SUSPENDERSE UNA FECHA POR RAZONES METEOROLÃ“GICAS U OTROS MOTIVOS, LA FECHA PROGRAMADA SE PASA PARA EL PRÃ“XIMO SÃBADO O FERIADO TAL CUAL ESTABA, PREVIO AVISO DE LA ORGANIZACION</p>\r\n                                \r\n                                <h3>1) DESARROLLO:</h3>\r\n                                <p>El Torneo contara de 30 equipos, divididos en 3 zonas de 10 equipos cada una (Zona A, Zona B y Zona C), con dos rondas de todos contra todos en cada zona. (Ida y vuelta, 18 fechas en total).<p>\r\n                                \r\n                                <p>En cada zona, se jugara en la modalidad todos contra todos.</p>\r\n                                <p>En todos los casos que se produzca una igualdad de puntos, ganara el equipo que tenga menor puntaje en la tabla de conducta, de persistir la igualdad, lo harÃ¡ el que posea mayor diferencia de goles, y de no haber desempatado, se verificara los goles a favor y por Ãºltimo, un sorteo entre los delegados de ambos equipos.</p>\r\n                                \r\n                                <blockquote>PARTIDO GANADO: 3 PUNTOS.</blockquote>\r\n                                <blockquote>PARTIDO EMPATADO: 1 PUNTO.</blockquote>\r\n                                <blockquote>PARTIDO PERDIDO: 0 PUNTO.</blockquote>\r\n                                \r\n                                <p><b>Los 3 Ãºltimos equipos de cada zona descienden y los primeros 3 equipos de cada zona ascienden.</b></p>\r\n                                \r\n                                <p>-En caso de que un equipo ingrese con el torneo comenzado (se lo considerarÃ¡ equipo "nuevo"), e ingresarÃ¡ en el mismo lugar del equipo que se encuentre Ãºltimo en la tabla de posiciones, con la diferencia de que no se tendrÃ¡n en cuenta los goles realizados pero si los goles recibidos. Tampoco participa de la "Copa Fair Play".</p>\r\n                                <p>-Si el equipo "nuevo" termina en posiciÃ³n de premio, lo ganarÃ¡. </p>\r\n                                \r\n                                <h3>2) REGLAMENTO:</h3>\r\n                                \r\n                                <p>Es igual al ya publicado en la pÃ¡gina, secciÃ³n <a href="reglamento.html">"Reglamento"</a>.</p>\r\n                                \r\n                                <h3>3) ESTADÃSTICAS Y FIXTURE:</h3>\r\n                                \r\n                                <p>EstadÃ­sticas: Las ESTADÃSTICAS se actualizarÃ¡n entre el Lunes y Martes a la noche posterior a cada fecha y aparecerÃ¡n en la secciÃ³n "EstadÃ­sticas" de la 