(2, '<div class="acc-container" style="color:#FFF;">\r\n                    <div class="acc-btn"><h1 class="selected">FUTBOL 11 SIN OFFSIDE</h1></div>\r\n                    <div class="acc-content open">\r\n                      <div class="acc-content-inner">\r\n                        <p>Los encuentros se disputaran los d?as s?bados y feriados, en los horarios de las 12, 13.30, 15 y 16.30.\r\n                                Advertencia Preliminar: Las disposiciones del presente Reglamento son de aplicaci?n para los campeonatos, torneos, partidos (amistosos u oficiales) y cualquier otro evento que sea organizado por LA ORGANIZACI?N, motivo por el cual deroga toda otra disposici?n que se oponga en todo o en parte al presente.</p>\r\n                                <h5><b>Art. 1. ASISTENCIA:</b></h5>\r\n                                <p>Los equipos se comprometen a asistir a TODOS los partidos del torneo. En caso de no poder presentar equipo una fecha, deben abonar la mitad  o la totalidad (seg?n el tiempo de aviso), del importe normal del partido SIN EXCEPCIONES, en concepto de reserva de ?rbitro, ambulancia, planillero, cancha, equipo rival sin jugar y organizaci?n. Al equipo que se qued? sin jugar, se le armara un amistoso con previo aviso por La Organizaci?n y tienen los puntos ganados concurriendo al amistoso. El amistoso ser? de menor valor que el partido oficial.</p>\r\n                                <p><b>A:</b> Los equipos deber?n presentarse 20 minutos antes del comienzo del partido.</p>\r\n                                <p>En caso de que un equipo no est? en condiciones de jugar <strong>(CON 5 JUGADORES YA EN LA CANCHA E INSCRIPTOS EN LA PLANILLA Y LA CANCHA ABONADA)</strong>, una vez cumplido el plazo m?ximo de espera (10 minutos), se le descontar? autom?ticamente un punto de los ya obtenidos en el torneo. Pasados 25 minutos de la hora de comienzo el equipo en espera tiene derecho a reclamar los puntos y se le dar? el partido ganado como 2-0. Si el equipo lleg? pasado el tiempo de espera m?ximo y el partido ya se dio como suspendido, se lo tendr? en cuenta como que <i>?no dio aviso de la no-concurrencia?</i>.</p>\r\n                                <p>En caso que se presenten los dos equipos, m?s all? de la demora, y el partido se haya suspendido, pueden jugar igualmente un amistoso en el resto del tiempo que queda en la cancha, el equipo que perdi? los puntos por llegar tarde, debe pagar lo normal de cada fecha (juegue o no juegue el amistoso), y el equipo que gano los puntos paga un valor menor. El tiempo del partido, va a ser menos, dependiendo los minutos de espera que hayan transcurrido, para desocupar la cancha a horario para el pr?ximo turno.</p>\r\n\r\n                                <h5><b>B:</b> La Cantidad m?nima de jugadores para estar en condiciones de jugar el partido, es de 7 jugadores por equipo.</h5>\r\n                                <h5><b>C:</b> El equipo que no se presente con camisetas iguales y numeradas ser? sancionado con 3 puntos negativos de <strong>FAIR PLAY</strong>. Si no tienen camisetas, se les dar?n 10 pecheras y deber?n abonar la suma de $ 50 (por partido).</h5>\r\n                                <h5><b>D:</b> La cantidad de suplentes es ilimitada; los cambios durante el partido ser?n 5 para el Torneo de Futbol 11, los cuales no son rotativos, un jugador que sali?, no puede volver a ingresar.</h5>\r\n                                <h5><b>E:</b> La Organizaci?n se reserva el derecho de admitir la entrada de cualquier persona al predio en el momento de disputarse los partidos.</h5>\r\n                                <h5><b>F:</b> En caso de que surja alguna duda con respecto a que se vaya a disputar la jornada, ya sea por razones clim?ticas o cualquier otra el capit?n o sub-capit?n deber? comunicarse el d?a del partido, despu?s de las 10am, con la organizaci?n mediante los tel?fonos que figuran en la p?gina web.</h5>\r\n                                <h5><b>G:</b> Avisos:</h5>\r\n                                <p><b>No aviso de la no-concurrencia:</b> Perder? los 3 puntos de la fecha, perder? 3 puntos de los ya obtenidos en el torneo, se le sumaran 10 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar el importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara <strong>ELIMINADO DEL TORNEO</strong>. Al equipo en espera, se le dan los puntos de la fecha (2-0).</p>\r\n                                <p>Aviso antes de las 10am del d?a de la fecha: Perder? los 3 puntos de la fecha, se le sumaran 10 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar el importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara eliminado del Torneo. Al equipo que se qued? sin jugar, se le dan los puntos de la fecha (2-0). Si el aviso es luego de las 10am, se tendr? en cuenta como que ?no dio aviso de la no-concurrencia? salvo fuerzas mayores (accidente, robo, choque, etc.), en ese caso, se tendr? en cuenta como que si dio aviso.</p>\r\n                                <p>Aviso antes de las 14pm del d?a anterior a la fecha: Perder? los 3 puntos de la fecha, se le sumaran 5 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar la mitad del importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara eliminado del Torneo.</p>\r\n                                <p><b>EQUIPOS QUE FALTEN SIN AVISAR, O FALTEN DOS VECES AL TORNEO, SERAN TENIDOS EN CUENTA PARA LA EXPULSION DEL TORNEO, LO CUAL QUEDA A CRITERIO DE LA ORGANIZACI?N.</b></p>\r\n                                <h5><b>H:</b> La Organizaci?n se reserva el derecho de expulsar a cualquier jugador, equipo y/o persona del Predio, partido y/o equipo, por cualquier actitud que la Organizaci?n no crea correcta o adecuada para la buena convivencia dentro del predio y los partidos o que infieran en la buena organizaci?n del Torneo. <strong>AL MENOS QUE LA ORGANIZACI?N LO DECIDA, NO HAY EXCEPCIONES PARA LAS EXPULSIONES.</strong></h5>\r\n                                <h5><b>Art. 2. LESIONES:</b></h5>\r\n                                <p>La organizaci?n no se har? cargo de las lesiones que puedan sufrir los jugadores durante el desarrollo del torneo. Se dispondr? de una ambulancia con presencia f?sica en el predio, con un m?dico a cargo. Tanto el m?dico como la ambulancia, estar?n a disposici?n de los jugadores que se lesionen durante los partidos.</p>\r\n                                <p>Seg?n el grado de lesi?n, el m?dico ser? el que decida si el jugador puede volver a jugar o no, una vez que haya sido atendido.</p>\r\n                                <h5><b>Art. 3 REQUISITOS PARA PARTICIPAR DE LOS EVENTOS:</b>\r\n                                <p>S?lo podr?n participar de los distintos eventos organizados por LA ORGANIZACI?N las personas que posean m?s de 16 a?os de edad inclusive, y que presenten en tiempo y forma la totalidad de la documentaci?n requerida por <strong>LA ORGANIZACI?N</strong> para cada una de las competencias de que se trate, salvo excepciones quienes estar?n autorizada por la Organizaci?n siempre y cuando presente la documentaci?n requerida en tiempo y forma, y con la anticipaci?n necesaria para poder evaluar su condici?n. </p>\r\n                                <p><b>A:</b>  La totalidad de las personas que participen de cualquier actividad y/o evento que sea organizado por <strong>LA ORGANIZACI?N</strong> deber?n presentar antes de la iniciaci?n de la competencia a desarrollarse o dentro del tiempo que estipule expresamente LA ORGANIZACI?N, la siguiente documentaci?n, a saber: a) Documento Nacional de Identidad (DNI) ; b) En el supuesto caso de ser menor de dieciocho a?os de edad (18), adem?s de los requisitos anteriormente se?alados, se deber? presentar autorizaci?n expresa de los padres para participar de la actividad de que se trate <strong>SIN EXCEPCION</strong> (Se les dar? una planilla, echa por La Organizaci?n, para que firmen dicha planilla, de esa manera, con la planilla completa, quedan autorizados a jugar).</p>\r\n                                <p><b>B:</b> La inscripci?n del equipo, podr? realizarse hasta el lunes anterior a la primera fecha de comienzo del Torneo, abonando lo establecido de inscripci?n y/o seguro por <strong>LA ORGANIZACI?N</strong>.</p>\r\n                                <p><b>C:</b> Bajo ning?n concepto se permitir? a los jugadores el ingreso al campo de juego con un miembro enyesado o entablillado, reloj, anillo, pulsera, aros, piercings, cadenas con medallas o cualquier otro elemento que ponga en riesgo la integridad f?sica tanto de si mismo, como de otro jugador. En caso de que un jugador no pueda sacarse cualquier de estos objetos, comenzara el partido con una tarjeta amarilla. Tampoco podr?n jugar el partido con tapones de metal.</p>\r\n                                <h5><b>Art. 4. ADMINISTRATIVO:</b></h5>\r\n                                <p>Con anterioridad al comienzo de cada encuentro (20 minutos antes) TODOS los jugadores deber?n presentarse en la mesa de control con su DNI o cualquier documento que acredite su identidad.</p>\r\n                                <p>No habr? una lista fija, esto posibilitar? que cada s?bado se presente el equipo que se quiera, con la ?nica prohibici?n de que un jugador que jug? para un equipo, ya no lo podr? hacer para otro (mientras este siga jugando el torneo). Si podr? jugar para equipos de distintas zonas.</p>\r\n                                <p><b>A:</b> El planillero recibir?, antes de empezar el partido, la suma que corresponde a cada equipo en concepto de arbitraje, instalaciones, ambulancia, m?dico, seguridad, premios y organizaci?n.</p>\r\n                                <p>El cumplimiento de este ?tem ser? estrictamente obligatorio, ya que de no ser as? el equipo no estar? autorizado a tomar parte del encuentro perdiendo autom?ticamente los puntos en juego sin tener derecho a reclamo alguno.</p>\r\n                                <p><b>B:</b> Equipamiento: Los jugadores deber?n presentarse con camisetas iguales y las camisetas que se utilicen deben estar numeradas. Caso contrario, se les sumaran 3 puntos negativos de <strong>FAIR PLAY</strong>.</p>\r\n                                <p><b>C: Pelotas:</b> los partidos se disputar?n con DOS (2) pelotas por cancha, las cuales est?n a cargo de los capitanes de ambos equipos. Al final del partido, ambas pelotas deben ser entregadas por parte de los capitanes al planillero correspondiente de su cancha. En caso que alguna/s pelota/s faltasen al finalizar el partido y no sean entregadas ambas al planillero, cada equipo debe abonar la suma de $400 por pelota. La organizaci?n dispondr? de personas alcanzapelotas detr?s de los arcos que dan a los descampados, como ayuda para buscarlas, pero tantos los dos capitanes, como ambos equipos, son responsables por las dos pelotas. Los planilleros NO tienen la funci?n de alcanzapelotas. Los ?rbitros son los UNICOS autorizados a pedir la pelota de repuesto a los alcanzapelotas, los cuales se la dar?n si la misma se fue para el lado del descampado y la entregaran ?nicamente si el <strong>?RBITRO</strong> la pide, en caso de que la pelota se vaya para el lado del estacionamiento, o adentro del predio <strong>LA DEBEN IR A BUSCAR LOS JUGADORES</strong>.</p>\r\n                                <p><b>D: Deposito:</b> Todos los equipos deben abonar el total de la ?ltima fecha del torneo en un plazo de 4 fechas, desde la 1ra fecha hasta la 4ta fecha es el plazo para abonarlo, en caso de no completar el deposito en tiempo y forma, <strong>NO</strong> sumaran puntos hasta completarlo, en caso de que <strong>NO</strong> faltasen a ning?n partido, la ?ltima fecha la juegan gratis. En caso de faltar a alguna fecha (dependiendo la anticipaci?n con que se dio aviso, explicado en el <strong>"Art. 1 ASISTENCIA"</strong>), se les descontara el monto del partido del dep?sito que dejaron.</p>\r\n                                <h5><b>Art. 5. PENAS:</b></h5>\r\n                                <p>Al equipo que se le compruebe que introdujo en alg?n partido un jugador que no est? debidamente habilitado para jugar se le descontaran autom?ticamente los puntos obtenidos en el mismo, mientras que a dicho jugador se lo sancionar? con 1 fecha de suspensi?n. Adem?s ser? un motivo a tener en cuenta para la expulsi?n del torneo. Los puntos de ese partido ir?n autom?ticamente para el equipo rival de esa fecha. (2-0). (si el equipo que gan?, no fue el que cometi? la falta, y convirti? m?s de 2 goles, el resultado ser?, los goles que hizo ese equipo, a 0 del equipo que cometi? la falta.)</p>\r\n                                <p><i>EJ: el equipo A gan? 4 a 3, y el equipo B cometi? la falta. El resultado ser? de 4-0 a favor del equipo A.</i></p>\r\n                                <p><b>A:</b> De suspenderse un partido por mal comportamiento de un equipo. El equipo rival (sea cual sea el resultado de ese momento) ganar? los puntos (2-0), (como m?nimo, en caso de que est?n empatando o perdiendo). Si en ese momento hab?a convertido m?s goles y estaba ganando, se computar?n esa cantidad a 0. (Como en el ejemplo del p?rrafo anterior).</p>\r\n                                <p><b>B:</b> Todo jugador o equipo que a lo largo del torneo demuestre una conducta violenta o agresiva con rivales, ?rbitros, compa?eros, organizadores, y p?blico en general ser? sancionado seg?n la gravedad del hecho hasta con la exclusi?n definitiva del evento sin tener derecho a reclamo alguno.</p>\r\n                                <p><b>C:</b> El jugador que acumule 3 tarjetas amarillas, ser? sancionado con 1 (una) fecha de suspensi?n.</p>\r\n                                <p><b>D:</b> Ninguna fecha (de suspensi?n) ser? posible de levantar.</p>\r\n                                <p><b>E:</b> La suspensi?n, se cumplir? igualmente si el partido no se juega por la falta de alguno de los equipos.</p>\r\n                                <p><b>F: La cantidad de fechas de suspensi?n por una expulsi?n o la exclusi?n definitiva del jugador o del equipo en su totalidad del torneo, quedara pura y exclusivamente a criterio de la organizaci?n bas?ndose en los informes respectivos de los ?rbitros, los visores, los descargos respectivos que realicen los capitanes y lo que juzguen los organizadores.</b>\r\n                                <blockquote>SE TENDRA EN CUENTA: LOS ANTECEDENTES DEL JUGADOR / EQUIPO Y SU CONDICION (si es capit?n o sub-capit?n).</blockquote>\r\n                                <p><b>G: EL EQUIPO QUE LLEGUE A SUMAR 60 PUNTOS DE FAIR PLAY, SER? EXPULSADO DEL TORNEO</b>. Quedar? a criterio de La Organizaci?n si es expulsado en la fecha que lleg? a los 60 puntos de Fair Play, o al finalizar el torneo.</p>\r\n                                <p><b>H:</b> Tanto los ?rbitros, como los veedores tienen la misma responsabilidad y derechos una vez comenzado el partido. Cualquier persona, sea jugador o no, agreda tanto verbal como f?sicamente o moleste al ?rbitro o veedor, ser? autom?ticamente expulsada del predio sin reclamo alguno.</p>\r\n                                <h5><b>Art. 6. CAPITANES:</b></h5>\r\n                                <p>El que figura como capit?n es el responsable del equipo; dicho puesto, podr? cambiarse a lo largo del torneo con una semana de anticipaci?n, en caso contrario, no se tendr? en cuenta el cambio. En caso de ausencia del capit?n, el responsable del equipo ser? el sub-capit?n (mismas funciones).</p>\r\n                                <p><b>A:</b> Para evitar desacoples en la transmisi?n de los mensajes a los capitanes, cada equipo deber? disponer de una casilla de e-mail. Se dispondr? de una p?gina web del torneo para que tanto los capitanes como los jugadores puedan observar los informes. La p?gina se actualizar? los Martes por la noche.</p>\r\n                                <p><b>B:</b> Los descargos los deber? realizar el capit?n o el sub-capit?n, con tiempo hasta el d?a Domingo (a la noche).</p>\r\n                                <h5><b>Art. 7. REGLAMENTO DISCIPLINARIO:</b></h5>\r\n                                <p>Este ser? el de la A.F.A. (se jugar? sin off-side) y habr? un ?rbitro dentro de la cancha, y un visor fuera de la cancha para facilitar la tarea del ?rbitro, en caso de que surja alguna situaci?n que el ?rbitro no vio, y el visor del partido si, se tendr? en cuenta la palabra del visor. Los partidos estar?n divididos en dos tiempos de 35 minutos, con 5 minutos de descanso entre cada tiempo. El tiempo extra de juego queda a criterio del ?rbitro de adicionarlo o no.</p>\r\n                                <p>La cantidad de suplentes es ilimitada; los cambios durante el partido ser?n 5, los cuales NO son rotativos, un jugador que sali?, no puede volver a ingresar.</p>\r\n                                <p>Los jugadores NO pueden jugar con tapones de aluminio.</p>\r\n                                <h5><b>Art. 8. MECANISMO DEL TORNEO:</b></h5>\r\n                                <p><b>A:</b> El torneo se desarrollara en 3 zonas de 10 equipos cada una (Zona A , Zona B y Zona C), jug?ndose en cada una de ellas dos rondas de todos contra todos. (Ida y vuelta, 18 fechas en total)</p>\r\n                                <p><b>B:</b> Partido ganado: 3 puntos.</p>\r\n                                <p>Partido empatado: 1 punto para ambos equipos.</p>\r\n                                <p>Partido perdido: 0 puntos.</p>\r\n\r\n                                <h5>Al finalizar el torneo, los 3 ?ltimos de cada zona descender?n y los 3 primeros ascender?n.</h5>\r\n\r\n                                <h5><b>C: COPA FAIR PLAY</b></h5>\r\n\r\n                                <p>El equipo que llegue a sumar 60 puntos de Fair Play, ser? expulsado del Torneo. </p>\r\n                                <p>Aclaraci?n: La expulsi?n del equipo del torneo queda a decisi?n de la organizaci?n cuando se realizara (si durante el transcurso del torneo, o al finalizar el torneo).</p>\r\n\r\n                                <p>1 punto por cada tarjeta amarilla.</p>\r\n                                <p>3 puntos por no presentarse con camisetas iguales y numeradas.</p>\r\n                                <p>3 puntos por cada tarjeta roja.</p>\r\n                                <p>5 puntos por no presentarse, con aviso antes de las 14pm del d?a anterior a la fecha.</p>\r\n                                <p>10 puntos por no presentarse, sin aviso o antes de las 10am del d?a de la fecha.</p>\r\n                                <br>\r\n                                <p>Exclusi?n de la copa, si no se presenta, de o no de aviso. (10 puntos para la definici?n).</p>\r\n                                <p>El ganador de la Copa Fair Play, tendr? la inscripci?n GRATUITA para el pr?ximo Torneo.</p>\r\n                                <p>Los equipos nuevos, no participan de esta Copa.</p>\r\n\r\n                                <blockquote>Aclaraci?n: En caso de empate: Ganara el que haya asistido a m?s partidos, si persiste el empate, el que menos tarjetas rojas tenga, luego el que menos tarjetas amarillas tenga, en ?ltima instancia, por las posiciones del Torneo.</blockquote>\r\n\r\n                                <h5><b>Art. 9. MODIFICACIONES:</b></h5>\r\n                                <p><b>A:</b> Los organizadores se reservan la posibilidad de modificar el reglamento en cualquier momento. Las modificaciones siempre ser?n a futuro; y empezar?n a regir en la fecha siguiente de ser conocidas. Se dar?n a conocer en la p?gina principal <strong>(secci?n "AVISOS IMPORTANTES")</strong>.</p>\r\n                                <p><b>B:</b> Este reglamento se tendr? por conocido por todos los jugadores del torneo, y por el p?blico en general.</p>\r\n                                <p>La organizaci?n le quiere dar la bienvenida a los equipos y contarles que los objetivos del torneo no son otros que juntar grupos de amigos para <strong>JUGAR</strong> s?bado a s?bado y disfrutar lo que tanto nos apasiona que es El F?tbol.</p>\r\n\r\n                                <br>\r\n                                <h5>Queremos darle las gracias por interpretar nuestros objetivos y fomentar entre todos el <strong>BUEN AMBIENTE EN EL PREDIO!</strong></h5>\r\n                                <br>\r\n                                <h4>Atte. La Organizaci?n.</h4>\r\n                      </div>\r\n                    </div>\r\n                    \r\n                    <div class="acc-btn"><h1>FUTBOL 11 CON OFF-SIDE</h1></div>\r\n                    <div class="acc-content">\r\n                      <div class="acc-content-inner">\r\n                        <p>Los encuentros se disputaran los d?as s?bados y feriados, en los horarios de las 12, 13.30, 15 y 16.30.\r\n                                Advertencia Preliminar: Las disposiciones del presente Reglamento son de aplicaci?n para los campeonatos, torneos, partidos (amistosos u oficiales) y cualquier otro evento que sea organizado por LA ORGANIZACI?N, motivo por el cual deroga toda otra disposici?n que se oponga en todo o en parte al presente.</p>\r\n                                <h5><b>Art. 1. ASISTENCIA:</b></h5>\r\n                                <p>Los equipos se comprometen a asistir a TODOS los partidos del torneo. En caso de no poder presentar equipo una fecha, deben abonar la mitad  o la totalidad (seg?n el tiempo de aviso), del importe normal del partido SIN EXCEPCIONES, en concepto de reserva de ?rbitro, ambulancia, planillero, cancha, equipo rival sin jugar y organizaci?n. Al equipo que se qued? sin jugar, se le armara un amistoso con previo aviso por La Organizaci?n y tienen los puntos ganados concurriendo al amistoso. El amistoso ser? de menor valor que el partido oficial.</p>\r\n                                <p><b>A:</b> Los equipos deber?n presentarse 20 minutos antes del comienzo del partido.</p>\r\n                                <p>En caso de que un equipo no est? en condiciones de jugar <strong>(CON 5 JUGADORES YA EN LA CANCHA E INSCRIPTOS EN LA PLANILLA Y LA CANCHA ABONADA)</strong>, una vez cumplido el plazo m?ximo de espera (10 minutos), se le descontar? autom?ticamente un punto de los ya obtenidos en el torneo. Pasados 25 minutos de la hora de comienzo el equipo en espera tiene derecho a reclamar los puntos y se le dar? el partido ganado como 2-0. Si el equipo lleg? pasado el tiempo de espera m?ximo y el partido ya se dio como suspendido, se lo tendr? en cuenta como que <i>?no dio aviso de la no-concurrencia?</i>.</p>\r\n                                <p>En caso que se presenten los dos equipos, m?s all? de la demora, y el partido se haya suspendido, pueden jugar igualmente un amistoso en el resto del tiempo que queda en la cancha, el equipo que perdi? los puntos por llegar tarde, debe pagar lo normal de cada fecha (juegue o no juegue el amistoso), y el equipo que gano los puntos paga un valor menor. El tiempo del partido, va a ser menos, dependiendo los minutos de espera que hayan transcurrido, para desocupar la cancha a horario para el pr?ximo turno.</p>\r\n\r\n                                <h5><b>B:</b> La Cantidad m?nima de jugadores para estar en condiciones de jugar el partido, es de 7 jugadores por equipo.</h5>\r\n                                <h5><b>C:</b> El equipo que no se presente con camisetas iguales y numeradas ser? sancionado con 3 puntos negativos de <strong>FAIR PLAY</strong>. Si no tienen camisetas, se les dar?n 10 pecheras y deber?n abonar la suma de $ 50 (por partido).</h5>\r\n                                <h5><b>D:</b> La cantidad de suplentes es ilimitada; los cambios durante el partido ser?n 5 para el Torneo de Futbol 11, los cuales no son rotativos, un jugador que sali?, no puede volver a ingresar.</h5>\r\n                                <h5><b>E:</b> La Organizaci?n se reserva el derecho de admitir la entrada de cualquier persona al predio en el momento de disputarse los partidos.</h5>\r\n                                <h5><b>F:</b> En caso de que surja alguna duda con respecto a que se vaya a disputar la jornada, ya sea por razones clim?ticas o cualquier otra el capit?n o sub-capit?n deber? comunicarse el d?a del partido, despu?s de las 10am, con la organizaci?n mediante los tel?fonos que figuran en la p?gina web.</h5>\r\n                                <h5><b>G:</b> Avisos:</h5>\r\n                                <p><b>No aviso de la no-concurrencia:</b> Perder? los 3 puntos de la fecha, perder? 3 puntos de los ya obtenidos en el torneo, se le sumaran 10 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar el importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara <strong>ELIMINADO DEL TORNEO</strong>. Al equipo en espera, se le dan los puntos de la fecha (2-0).</p>\r\n                                <p>Aviso antes de las 10am del d?a de la fecha: Perder? los 3 puntos de la fecha, se le sumaran 10 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar el importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara eliminado del Torneo. Al equipo que se qued? sin jugar, se le dan los puntos de la fecha (2-0). Si el aviso es luego de las 10am, se tendr? en cuenta como que ?no dio aviso de la no-concurrencia? salvo fuerzas mayores (accidente, robo, choque, etc.), en ese caso, se tendr? en cuenta como que si dio aviso.</p>\r\n                                <p>Aviso antes de las 14pm del d?a anterior a la fecha: Perder? los 3 puntos de la fecha, se le sumaran 5 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar la mitad del importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara eliminado del Torneo.</p>\r\n                                <p><b>EQUIPOS QUE FALTEN SIN AVISAR, O FALTEN DOS VECES AL TORNEO, SERAN TENIDOS EN CUENTA PARA LA EXPULSION DEL TORNEO, LO CUAL QUEDA A CRITERIO DE LA ORGANIZACI?N.</b></p>\r\n                                <h5><b>H:</b> La Organizaci?n se reserva el derecho de expulsar a cualquier jugador, equipo y/o persona del Predio, partido y/o equipo, por cualquier actitud que la Organizaci?n no crea correcta o adecuada para la buena convivencia dentro del predio y los partidos o que infieran en la buena organizaci?n del Torneo. <strong>AL MENOS QUE LA ORGANIZACI?N LO DECIDA, NO HAY EXCEPCIONES PARA LAS EXPULSIONES.</strong></h5>\r\n                                <h5><b>Art. 2. LESIONES:</b></h5>\r\n                                <p>La organizaci?n no se har? cargo de las lesiones que puedan sufrir los jugadores durante el desarrollo del torneo. Se dispondr? de una ambulancia con presencia f?sica en el predio, con un m?dico a cargo. Tanto el m?dico como la ambulancia, estar?n a disposici?n de los jugadores que se lesionen durante los partidos.</p>\r\n                                <p>Seg?n el grado de lesi?n, el m?dico ser? el que decida si el jugador puede volver a jugar o no, una vez que haya sido atendido.</p>\r\n                                <h5><b>Art. 3 REQUISITOS PARA PARTICIPAR DE LOS EVENTOS:</b>\r\n                                <p>S?lo podr?n participar de los distintos eventos organizados por LA ORGANIZACI?N las personas que posean m?s de 16 a?os de edad inclusive, y que presenten en tiempo y forma la totalidad de la documentaci?n requerida por <strong>LA ORGANIZACI?N</strong> para cada una de las competencias de que se trate, salvo excepciones quienes estar?n autorizada por la Organizaci?n siempre y cuando presente la documentaci?n requerida en tiempo y forma, y con la anticipaci?n necesaria para poder evaluar su condici?n. </p>\r\n                                <p><b>A:</b>  La totalidad de las personas que participen de cualquier actividad y/o evento que sea organizado por <strong>LA ORGANIZACI?N</strong> deber?n presentar antes de la iniciaci?n de la competencia a desarrollarse o dentro del tiempo que estipule expresamente LA ORGANIZACI?N, la siguiente documentaci?n, a saber: a) Documento Nacional de Identidad (DNI) ; b) En el supuesto caso de ser menor de dieciocho a?os de edad (18), adem?s de los requisitos anteriormente se?alados, se deber? presentar autorizaci?n expresa de los padres para participar de la actividad de que se trate <strong>SIN EXCEPCION</strong> (Se les dar? una planilla, echa por La Organizaci?n, para que firmen dicha planilla, de esa manera, con la planilla completa, quedan autorizados a jugar).</p>\r\n                                <p><b>B:</b> La inscripci?n del equipo, podr? realizarse hasta el lunes anterior a la primera fecha de comienzo del Torneo, abonando lo establecido de inscripci?n y/o seguro por <strong>LA ORGANIZACI?N</strong>.</p>\r\n                                <p><b>C:</b> Bajo ning?n concepto se permitir? a los jugadores el ingreso al campo de juego con un miembro enyesado o entablillado, reloj, anillo, pulsera, aros, piercings, cadenas con medallas o cualquier otro elemento que ponga en riesgo la integridad f?sica tanto de si mismo, como de otro jugador. En caso de que un jugador no pueda sacarse cualquier de estos objetos, comenzara el partido con una tarjeta amarilla. Tampoco podr?n jugar el partido con tapones de metal.</p>\r\n                                <h5><b>Art. 4. ADMINISTRATIVO:</b></h5>\r\n                                <p>Con anterioridad al comienzo de cada encuentro (20 minutos antes) TODOS los jugadores deber?n presentarse en la mesa de control con su DNI o cualquier documento que acredite su identidad.</p>\r\n                                <p>No habr? una lista fija, esto posibilitar? que cada s?bado se presente el equipo que se quiera, con la ?nica prohibici?n de que un jugador que jug? para un equipo, ya no lo podr? hacer para otro (mientras este siga jugando el torneo). Si podr? jugar para equipos de distintas zonas.</p>\r\n                                <p><b>A:</b> El planillero recibir?, antes de empezar el partido, la suma que corresponde a cada equipo en concepto de arbitraje, instalaciones, ambulancia, m?dico, seguridad, premios y organizaci?n.</p>\r\n                                <p>El cumplimiento de este ?tem ser? estrictamente obligatorio, ya que de no ser as? el equipo no estar? autorizado a tomar parte del encuentro perdiendo autom?ticamente los puntos en juego sin tener derecho a reclamo alguno.</p>\r\n                                <p><b>B:</b> Equipamiento: Los jugadores deber?n presentarse con camisetas iguales y las camisetas que se utilicen deben estar numeradas. Caso contrario, se les sumaran 3 puntos negativos de <strong>FAIR PLAY</strong>.</p>\r\n                                <p><b>C: Pelotas:</b> los partidos se disputar?n con DOS (2) pelotas por cancha, las cuales est?n a cargo de los capitanes de ambos equipos. Al final del partido, ambas pelotas deben ser entregadas por parte de los capitanes al planillero correspondiente de su cancha. En caso que alguna/s pelota/s faltasen al finalizar el partido y no sean entregadas ambas al planillero, cada equipo debe abonar la suma de $400 por pelota. La organizaci?n dispondr? de personas alcanzapelotas detr?s de los arcos que dan a los descampados, como ayuda para buscarlas, pero tantos los dos capitanes, como ambos equipos, son responsables por las dos pelotas. Los planilleros NO tienen la funci?n de alcanzapelotas. Los ?rbitros son los UNICOS autorizados a pedir la pelota de repuesto a los alcanzapelotas, los cuales se la dar?n si la misma se fue para el lado del descampado y la entregaran ?nicamente si el <strong>?RBITRO</strong> la pide, en caso de que la pelota se vaya para el lado del estacionamiento, o adentro del predio <strong>LA DEBEN IR A BUSCAR LOS JUGADORES</strong>.</p>\r\n                                <p><b>D: Deposito:</b> Todos los equipos deben abonar el total de la ?ltima fecha del torneo en un plazo de 4 fechas, desde la 1ra fecha hasta la 4ta fecha es el plazo para abonarlo, en caso de no completar el deposito en tiempo y forma, <strong>NO</strong> sumaran puntos hasta completarlo, en caso de que <strong>NO</strong> faltasen a ning?n partido, la ?ltima fecha la juegan gratis. En caso de faltar a alguna fecha (dependiendo la anticipaci?n con que se dio aviso, explicado en el <strong>"Art. 1 ASISTENCIA"</strong>), se les descontara el monto del partido del dep?sito que dejaron.</p>\r\n                                <h5><b>Art. 5. PENAS:</b></h5>\r\n                                <p>Al equipo que se le compruebe que introdujo en alg?n partido un jugador que no est? debidamente habilitado para jugar se le descontaran autom?ticamente los puntos obtenidos en el mismo, mientras que a dicho jugador se lo sancionar? con 1 fecha de suspensi?n. Adem?s ser? un motivo a tener en cuenta para la expulsi?n del torneo. Los puntos de ese partido ir?n autom?ticamente para el equipo rival de esa fecha. (2-0). (si el equipo que gan?, no fue el que cometi? la falta, y convirti? m?s de 2 goles, el resultado ser?, los goles que hizo ese equipo, a 0 del equipo que cometi? la falta.)</p>\r\n                                <p><i>EJ: el equipo A gan? 4 a 3, y el equipo B cometi? la falta. El resultado ser? de 4-0 a favor del equipo A.</i></p>\r\n                                <p><b>A:</b> De suspenderse un partido por mal comportamiento de un equipo. El equipo rival (sea cual sea el resultado de ese momento) ganar? los puntos (2-0), (como m?nimo, en caso de que est?n empatando o perdiendo). Si en ese momento hab?a convertido m?s goles y estaba ganando, se computar?n esa cantidad a 0. (Como en el ejemplo del p?rrafo anterior).</p>\r\n                                <p><b>B:</b> Todo jugador o equipo que a lo largo del torneo demuestre una conducta violenta o agresiva con rivales, ?rbitros, compa?eros, organizadores, y p?blico en general ser? sancionado seg?n la gravedad del hecho hasta con la exclusi?n definitiva del evento sin tener derecho a reclamo alguno.</p>\r\n                                <p><b>C:</b> El jugador que acumule 3 tarjetas amarillas, ser? sancionado con 1 (una) fecha de suspensi?n.</p>\r\n                                <p><b>D:</b> Ninguna fecha (de suspensi?n) ser? posible de levantar.</p>\r\n                                <p><b>E:</b> La suspensi?n, se cumplir? igualmente si el partido no se juega por la falta de alguno de los equipos.</p>\r\n                                <p><b>F: La cantidad de fechas de suspensi?n por una expulsi?n o la exclusi?n definitiva del jugador o del equipo en su totalidad del torneo, quedara pura y exclusivamente a criterio de la organizaci?n bas?ndose en los informes respectivos de los ?rbitros, los visores, los descargos respectivos que realicen los capitanes y lo que juzguen los organizadores.</b>\r\n                                <blockquote>SE TENDRA EN CUENTA: LOS ANTECEDENTES DEL JUGADOR / EQUIPO Y SU CONDICION (si es capit?n o sub-capit?n).</blockquote>\r\n                                <p><b>G: EL EQUIPO QUE LLEGUE A SUMAR 60 PUNTOS DE FAIR PLAY, SER? EXPULSADO DEL TORNEO</b>. Quedar? a criterio de La Organizaci?n si es expulsado en la fecha que lleg? a los 60 puntos de Fair Play, o al finalizar el torneo.</p>\r\n                                <p><b>H:</b> Tanto los ?rbitros, como los veedores tienen la misma responsabilidad y derechos una vez comenzado el partido. Cualquier persona, sea jugador o no, agreda tanto verbal como f?sicamente o moleste al ?rbitro o veedor, ser? autom?ticamente expulsada del predio sin reclamo alguno.</p>\r\n                                <h5><b>Art. 6. CAPITANES:</b></h5>\r\n                                <p>El que figura como capit?n es el responsable del equipo; dicho puesto, podr? cambiarse a lo largo del torneo con una semana de anticipaci?n, en caso contrario, no se tendr? en cuenta el cambio. En caso de ausencia del capit?n, el responsable del equipo ser? el sub-capit?n (mismas funciones).</p>\r\n                                <p><b>A:</b> Para evitar desacoples en la transmisi?n de los mensajes a los capitanes, cada equipo deber? disponer de una casilla de e-mail. Se dispondr? de una p?gina web del torneo para que tanto los capitanes como los jugadores puedan observar los informes. La p?gina se actualizar? los Martes por la noche.</p>\r\n                                <p><b>B:</b> Los descargos los deber? realizar el capit?n o el sub-capit?n, con tiempo hasta el d?a Domingo (a la noche).</p>\r\n                                <h5><b>Art. 7. REGLAMENTO DISCIPLINARIO:</b></h5>\r\n                                <p>Este ser? el de la A.F.A. (se jugar? sin off-side) y habr? un ?rbitro dentro de la cancha, y un visor fuera de la cancha para facilitar la tarea del ?rbitro, en caso de que surja alguna situaci?n que el ?rbitro no vio, y el visor del partido si, se tendr? en cuenta la palabra del visor. Los partidos estar?n divididos en dos tiempos de 35 minutos, con 5 minutos de descanso entre cada tiempo. El tiempo extra de juego queda a criterio del ?rbitro de adicionarlo o no.</p>\r\n                                <p>La cantidad de suplentes es ilimitada; los cambios durante el partido ser?n 5, los cuales NO son rotativos, un jugador que sali?, no puede volver a ingresar.</p>\r\n                                <p>Los jugadores NO pueden jugar con tapones de aluminio.</p>\r\n                                <h5><b>Art. 8. MECANISMO DEL TORNEO:</b></h5>\r\n                                <p><b>A:</b> El torneo se desarrollara en 3 zonas de 10 equipos cada una (Zona A , Zona B y Zona C), jug?ndose en cada una de ellas dos rondas de todos contra todos. (Ida y vuelta, 18 fechas en total)</p>\r\n                                <p><b>B:</b> Partido ganado: 3 puntos.</p>\r\n                                <p>Partido empatado: 1 punto para ambos equipos.</p>\r\n                                <p>Partido perdido: 0 puntos.</p>\r\n\r\n                                <h5>Al finalizar el torneo, los 3 ?ltimos de cada zona descender?n y los 3 primeros ascender?n.</h5>\r\n\r\n                                <h5><b>C: COPA FAIR PLAY</b></h5>\r\n\r\n                                <p>El equipo que llegue a sumar 60 puntos de Fair Play, ser? expulsado del Torneo. </p>\r\n                                <p>Aclaraci?n: La expulsi?n del equipo del torneo queda a decisi?n de la organizaci?n cuando se realizara (si durante el transcurso del torneo, o al finalizar el torneo).</p>\r\n\r\n                                <p>1 punto por cada tarjeta amarilla.</p>\r\n                                <p>3 puntos por no presentarse con camisetas iguales y numeradas.</p>\r\n                                <p>3 puntos por cada tarjeta roja.</p>\r\n                                <p>5 puntos por no presentarse, con aviso antes de las 14pm del d?a anterior a la fecha.</p>\r\n                                <p>10 puntos por no presentarse, sin aviso o antes de las 10am del d?a de la fecha.</p>\r\n                                <br>\r\n                                <p>Exclusi?n de la copa, si no se presenta, de o no de aviso. (10 puntos para la definici?n).</p>\r\n                                <p>El ganador de la Copa Fair Play, tendr? la inscripci?n GRATUITA para el pr?ximo Torneo.</p>\r\n                                <p>Los equipos nuevos, no participan de esta Copa.</p>\r\n\r\n                                <blockquote>Aclaraci?n: En caso de empate: Ganara el que haya asistido a m?s partidos, si persiste el empate, el que menos tarjetas rojas tenga, luego el que menos tarjetas amarillas tenga, en ?ltima instancia, por las posiciones del Torneo.</blockquote>\r\n\r\n                                <h5><b>Art. 9. MODIFICACIONES:</b></h5>\r\n                                <p><b>A:</b> Los organizadores se reservan la posibilidad de modificar el reglamento en cualquier momento. Las modificaciones siempre ser?n a futuro; y empezar?n a regir en la fecha siguiente de ser conocidas. Se dar?n a conocer en la p?gina principal <strong>(secci?n "AVISOS IMPORTANTES")</strong>.</p>\r\n                                <p><b>B:</b> Este reglamento se tendr? por conocido por todos los jugadores del torneo, y por el p?blico en general.</p>\r\n                                <p>La organizaci?n le quiere dar la bienvenida a los equipos y contarles que los objetivos del torneo no son otros que juntar grupos de amigos para <strong>JUGAR</strong> s?bado a s?bado y disfrutar lo que tanto nos apasiona que es El F?tbol.</p>\r\n\r\n                                <br>\r\n                                <h5>Queremos darle las gracias por interpretar nuestros objetivos y fomentar entre todos el <strong>BUEN AMBIENTE EN EL PREDIO!</strong></h5>\r\n                                <br>\r\n                                <h4>Atte. La Organizaci?n.</h4>\r\n                      </div>\r\n                    </div>\r\n                    \r\n                    <div class="acc-btn"><h1>FUTBOL 7</h1></div>\r\n                    <div class="acc-content">\r\n                      <div class="acc-content-inner">\r\n                        <p>Los encuentros se disputaran los d?as s?bados y feriados, en los horarios de las 12, 13.30, 15 y 16.30.\r\n                                Advertencia Preliminar: Las disposiciones del presente Reglamento son de aplicaci?n para los campeonatos, torneos, partidos (amistosos u oficiales) y cualquier otro evento que sea organizado por LA ORGANIZACI?N, motivo por el cual deroga toda otra disposici?n que se oponga en todo o en parte al presente.</p>\r\n                                <h5><b>Art. 1. ASISTENCIA:</b></h5>\r\n                                <p>Los equipos se comprometen a asistir a TODOS los partidos del torneo. En caso de no poder presentar equipo una fecha, deben abonar la mitad  o la totalidad (seg?n el tiempo de aviso), del importe normal del partido SIN EXCEPCIONES, en concepto de reserva de ?rbitro, ambulancia, planillero, cancha, equipo rival sin jugar y organizaci?n. Al equipo que se qued? sin jugar, se le armara un amistoso con previo aviso por La Organizaci?n y tienen los puntos ganados concurriendo al amistoso. El amistoso ser? de menor valor que el partido oficial.</p>\r\n                                <p><b>A:</b> Los equipos deber?n presentarse 20 minutos antes del comienzo del partido.</p>\r\n                                <p>En caso de que un equipo no est? en condiciones de jugar <strong>(CON 5 JUGADORES YA EN LA CANCHA E INSCRIPTOS EN LA PLANILLA Y LA CANCHA ABONADA)</strong>, una vez cumplido el plazo m?ximo de espera (10 minutos), se le descontar? autom?ticamente un punto de los ya obtenidos en el torneo. Pasados 25 minutos de la hora de comienzo el equipo en espera tiene derecho a reclamar los puntos y se le dar? el partido ganado como 2-0. Si el equipo lleg? pasado el tiempo de espera m?ximo y el partido ya se dio como suspendido, se lo tendr? en cuenta como que <i>?no dio aviso de la no-concurrencia?</i>.</p>\r\n                                <p>En caso que se presenten los dos equipos, m?s all? de la demora, y el partido se haya suspendido, pueden jugar igualmente un amistoso en el resto del tiempo que queda en la cancha, el equipo que perdi? los puntos por llegar tarde, debe pagar lo normal de cada fecha (juegue o no juegue el amistoso), y el equipo que gano los puntos paga un valor menor. El tiempo del partido, va a ser menos, dependiendo los minutos de espera que hayan transcurrido, para desocupar la cancha a horario para el pr?ximo turno.</p>\r\n\r\n                                <h5><b>B:</b> La Cantidad m?nima de jugadores para estar en condiciones de jugar el partido, es de 7 jugadores por equipo.</h5>\r\n                                <h5><b>C:</b> El equipo que no se presente con camisetas iguales y numeradas ser? sancionado con 3 puntos negativos de <strong>FAIR PLAY</strong>. Si no tienen camisetas, se les dar?n 10 pecheras y deber?n abonar la suma de $ 50 (por partido).</h5>\r\n                                <h5><b>D:</b> La cantidad de suplentes es ilimitada; los cambios durante el partido ser?n 5 para el Torneo de Futbol 11, los cuales no son rotativos, un jugador que sali?, no puede volver a ingresar.</h5>\r\n                                <h5><b>E:</b> La Organizaci?n se reserva el derecho de admitir la entrada de cualquier persona al predio en el momento de disputarse los partidos.</h5>\r\n                                <h5><b>F:</b> En caso de que surja alguna duda con respecto a que se vaya a disputar la jornada, ya sea por razones clim?ticas o cualquier otra el capit?n o sub-capit?n deber? comunicarse el d?a del partido, despu?s de las 10am, con la organizaci?n mediante los tel?fonos que figuran en la p?gina web.</h5>\r\n                                <h5><b>G:</b> Avisos:</h5>\r\n                                <p><b>No aviso de la no-concurrencia:</b> Perder? los 3 puntos de la fecha, perder? 3 puntos de los ya obtenidos en el torneo, se le sumaran 10 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar el importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara <strong>ELIMINADO DEL TORNEO</strong>. Al equipo en espera, se le dan los puntos de la fecha (2-0).</p>\r\n                                <p>Aviso antes de las 10am del d?a de la fecha: Perder? los 3 puntos de la fecha, se le sumaran 10 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar el importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara eliminado del Torneo. Al equipo que se qued? sin jugar, se le dan los puntos de la fecha (2-0). Si el aviso es luego de las 10am, se tendr? en cuenta como que ?no dio aviso de la no-concurrencia? salvo fuerzas mayores (accidente, robo, choque, etc.), en ese caso, se tendr? en cuenta como que si dio aviso.</p>\r\n                                <p>Aviso antes de las 14pm del d?a anterior a la fecha: Perder? los 3 puntos de la fecha, se le sumaran 5 puntos en la tabla de Fair Play, quedara excluido de la Copa Fair Play y deber? abonar la mitad del importe normal del partido <strong>SIN EXCEPCIONES</strong> y en caso que La Organizaci?n lo decida, quedara eliminado del Torneo.</p>\r\n                                <p><b>EQUIPOS QUE FALTEN SIN AVISAR, O FALTEN DOS VECES AL TORNEO, SERAN TENIDOS EN CUENTA PARA LA EXPULSION DEL TORNEO, LO CUAL QUEDA A CRITERIO DE LA ORGANIZACI?N.</b></p>\r\n                                <h5><b>H:</b> La Organizaci?n se reserva el derecho de expulsar a cualquier jugador, equipo y/o persona del Predio, partido y/o equipo, por cualquier actitud que la Organizaci?n no crea correcta o adecuada para la buena convivencia dentro del predio y los partidos o que infieran en la buena organizaci?n del Torneo. <strong>AL MENOS QUE LA ORGANIZACI?N LO DECIDA, NO HAY EXCEPCIONES PARA LAS EXPULSIONES.</strong></h5>\r\n                                <h5><b>Art. 2. LESIONES:</b></h5>\r\n                                <p>La organizaci?n no se har? cargo de las lesiones que puedan sufrir los jugadores durante el desarrollo del torneo. Se dispondr? de una ambulancia con presencia f?sica en el predio, con un m?dico a cargo. Tanto el m?dico como la ambulancia, estar?n a disposici?n de los jugadores que se lesionen durante los partidos.</p>\r\n                                <p>Seg?n el grado de lesi?n, el m?dico ser? el que decida si el jugador puede volver a jugar o no, una vez que haya sido atendido.</p>\r\n                                <h5><b>Art. 3 REQUISITOS PARA PARTICIPAR DE LOS EVENTOS:</b>\r\n                                <p>S?lo podr?n participar de los distintos eventos organizados por LA ORGANIZACI?N las personas que posean m?s de 16 a?os de edad inclusive, y que presenten en tiempo y forma la totalidad de la documentaci?n requerida por <strong>LA ORGANIZACI?N</strong> para cada una de las competencias de que se trate, salvo excepciones quienes estar?n autorizada por la Organizaci?n siempre y cuando presente la documentaci?n requerida en tiempo y forma, y con la anticipaci?n necesaria para poder evaluar su condici?n. </p>\r\n                                <p><b>A:</b>  La totalidad de las personas que participen de cualquier actividad y/o evento que sea organizado por <strong>LA ORGANIZACI?N</strong> deber?n presentar antes de la iniciaci?n de la competencia a desarrollarse o dentro del tiempo que estipule expresamente LA ORGANIZACI?N, la siguiente documentaci?n, a saber: a) Documento Nacional de Identidad (DNI) ; b) En el supuesto caso de ser menor de dieciocho a?os de edad (18), adem?s de los requisitos anteriormente se?alados, se deber? presentar autorizaci?n expresa de los padres para participar de la actividad de que se trate <strong>SIN EXCEPCION</strong> (Se les dar? una planilla, echa por La Organizaci?n, para que firmen dicha planilla, de esa manera, con la planilla completa, quedan autorizados a jugar).</p>\r\n                                <p><b>B:</b> La inscripci?n del equipo, podr? realizarse hasta el lunes anterior a la primera fecha de comienzo del Torneo, abonando lo establecido de inscripci?n y/o seguro por <strong>LA ORGANIZACI?N</strong>.</p>\r\n                                <p><b>C:</b> Bajo ning?n concepto se permitir? a los jugadores el ingreso al campo de juego con un miembro enyesado o entablillado, reloj, anillo, pulsera, aros, piercings, cadenas con medallas o cualquier otro elemento que ponga en riesgo la integridad f?sica tanto de si mismo, como de otro jugador. En caso de que un jugador no pueda sacarse cualquier de estos objetos, comenzara el partido con una tarjeta amarilla. Tampoco podr?n jugar el partido con tapones de metal.</p>\r\n                                <h5><b>Art. 4. ADMINISTRATIVO:</b></h5>\r\n                                <p>Con anterioridad al comienzo de cada encuentro (20 minutos antes) TODOS los jugadores deber?n presentarse en la mesa de control con su DNI o cualquier documento que acredite su identidad.</p>\r\n                                <p>No habr? una lista fija, esto posibilitar? que cada s?bado se presente el equipo que se quiera, con la ?nica prohibici?n de que un jugador que jug? para un equipo, ya no lo podr? hacer para otro (mientras este siga jugando el torneo). Si podr? jugar para equipos de distintas zonas.</p>\r\n                                <p><b>A:</b> El planillero recibir?, antes de empezar el partido, la suma que corresponde a cada equipo en concepto de arbitraje, instalaciones, ambulancia, m?dico, seguridad, premios y organizaci?n.</p>\r\n                                <p>El cumplimiento de este ?tem ser? estrictamente obligatorio, ya que de no ser as? el equipo no estar? autorizado a tomar parte del encuentro perdiendo autom?ticamente los puntos en juego sin tener derecho a reclamo alguno.</p>\r\n                                <p><b>B:</b> Equipamiento: Los jugadores deber?n presentarse con camisetas iguales y las camisetas que se utilicen deben estar numeradas. Caso contrario, se les sumaran 3 puntos negativos de <strong>FAIR PLAY</strong>.</p>\r\n                                <p><b>C: Pelotas:</b> los partidos se disputar?n con DOS (2) pelotas por cancha, las cuales est?n a cargo de los capitanes de ambos equipos. Al final del partido, ambas pelotas deben ser entregadas por parte de los capitanes al planillero correspondiente de su cancha. En caso que alguna/s pelota/s faltasen al finalizar el partido y no sean entregadas ambas al planillero, cada equipo debe abonar la suma de $400 por pelota. La organizaci?n dispondr? de personas alcanzapelotas detr?s de los arcos que dan a los descampados, como ayuda para buscarlas, pero tantos los dos capitanes, como ambos equipos, son responsables por las dos pelotas. Los planilleros NO tienen la funci?n de alcanzapelotas. Los ?rbitros son los UNICOS autorizados a pedir la pelota de repuesto a los alcanzapelotas, los cuales se la dar?n si la misma se fue para el lado del descampado y la entregaran ?nicamente si el <strong>?RBITRO</strong> la pide, en caso de que la pelota se vaya para el lado del estacionamiento, o adentro del predio <strong>LA DEBEN IR A BUSCAR LOS JUGADORES</strong>.</p>\r\n                                <p><b>D: Deposito:</b> Todos los equipos deben abonar el total de la ?ltima fecha del torneo en un plazo de 4 fechas, desde la 1ra fecha hasta la 4ta fecha es el plazo para abonarlo, en caso de no completar el deposito en tiempo y forma, <strong>NO</strong> sumaran puntos hasta completarlo, en caso de que <strong>NO</strong> faltasen a ning?n partido, la ?ltima fecha la juegan gratis. En caso de faltar a alguna fecha (dependiendo la anticipaci?n con que se dio aviso, explicado en el <strong>"Art. 1 ASISTENCIA"</strong>), se les descontara el monto del partido del dep?sito que dejaron.</p>\r\n                                <h5><b>Art. 5. PENAS:</b></h5>\r\n                                <p>Al equipo que se le compruebe que introdujo en alg?n partido un jugador que no est? debidamente habilitado para jugar se le descontaran autom?ticamente los puntos obtenidos en el mismo, mientras que a dicho jugador se lo sancionar? con 1 fecha de suspensi?n. Adem?s ser? un motivo a tener en cuenta para la expulsi?n del torneo. Los puntos de ese partido ir?n autom?ticamente para el equipo rival de esa fecha. (2-0). (si el equipo que gan?, no fue el que cometi? la falta, y convirti? m?s de 2 goles, el resultado ser?, los goles que hizo ese equipo, a 0 del equipo que cometi? la falta.)</p>\r\n                                <p><i>EJ: el equipo A gan? 4 a 3, y el equipo B cometi? la falta. El resultado ser? de 4-0 a favor del equipo A.</i></p>\r\n                                <p><b>A:</b> De suspenderse un partido por mal comportamiento de un equipo. El equipo rival (sea cual sea el resultado de ese momento) ganar? los puntos (2-0), (como m?nimo, en caso de que est?n empatando o perdiendo). Si en ese momento hab?a convertido m?s goles y estaba ganando, se computar?n esa cantidad a 0. (Como en el ejemplo del p?rrafo anterior).</p>\r\n                                <p><b>B:</b> Todo jugador o equipo que a lo largo del torneo demuestre una conducta violenta o agresiva con rivales, ?rbitros, compa?eros, organizadores, y p?blico en general ser? sancionado seg?n la gravedad del hecho hasta con la exclusi?n definitiva del evento sin tener derecho a reclamo alguno.</p>\r\n                                <p><b>C:</b> El jugador que acumule 3 tarjetas amarillas, ser? sancionado con 1 (una) fecha de suspensi?n.</p>\r\n                                <p><b>D:</b> Ninguna fecha (de suspensi?n) ser? posible de levantar.</p>\r\n                                <p><b>E:</b> La suspensi?n, se cumplir? igualmente si el partido no se juega por la falta de alguno de los equipos.</p>\r\n                                <p><b>F: La cantidad de fechas de suspensi?n por una expulsi?n o la exclusi?n definitiva del jugador o del equipo en su totalidad del torneo, quedara pura y exclusivamente a criterio de la organizaci?n bas?ndose en los informes respectivos de los ?rbitros, los visores, los descargos respectivos que realicen los capitanes y lo que juzguen los organizadores.</b>\r\n                                <blockquote>SE TENDRA EN CUENTA: LOS ANTECEDENTES DEL JUGADOR / EQUIPO Y SU CONDICION (si es capit?n o sub-capit?n).</blockquote>\r\n                                <p><b>G: EL EQUIPO QUE LLEGUE A SUMAR 60 PUNTOS DE FAIR PLAY, SER? EXPULSADO DEL TORNEO</b>. Quedar? a criterio de La Organizaci?n si es expulsado en la fecha que lleg? a los 60 puntos de Fair Play, o al finalizar el torneo.</p>\r\n                                <p><b>H:</b> Tanto los ?rbitros, como los veedores tienen la misma responsabilidad y derechos una vez comenzado el partido. Cualquier persona, sea jugador o no, agreda tanto verbal como f?sicamente o moleste al ?rbitro o veedor, ser? autom?ticamente expulsada del predio sin reclamo alguno.</p>\r\n                                <h5><b>Art. 6. CAPITANES:</b></h5>\r\n                                <p>El que figura como capit?n es el responsable del equipo; dicho puesto, podr? cambiarse a lo largo del torneo con una semana de anticipaci?n, en caso contrario, no se tendr? en cuenta el cambio. En caso de ausencia del capit?n, el responsable del equipo ser? el sub-capit?n (mismas funciones).</p>\r\n                                <p><b>A:</b> Para evitar desacoples en la transmisi?n de los mensajes a los capitanes, cada equipo deber? disponer de una casilla de e-mail. Se dispondr? de una p?gina web del torneo para que tanto los capitanes como los jugadores puedan observar los informes. La p?gina se actualizar? los Martes por la noche.</p>\r\n                                <p><b>B:</b> Los descargos los deber? realizar el capit?n o el sub-capit?n, con tiempo hasta el d?a Domingo (a la noche).</p>\r\n                                <h5><b>Art. 7. REGLAMENTO DISCIPLINARIO:</b></h5>\r\n                                <p>Este ser? el de la A.F.A. (se jugar? sin off-side) y habr? un ?rbitro dentro de la cancha, y un visor fuera de la cancha para facilitar la tarea del ?rbitro, en caso de que surja alguna situaci?n que el ?rbitro no vio, y el visor del partido si, se tendr? en cuenta la palabra del visor. Los partidos estar?n divididos en dos tiempos de 35 minutos, con 5 minutos de descanso entre cada tiempo. El tiempo extra de juego queda a criterio del ?rbitro de adicionarlo o no.</p>\r\n                                <p>La cantidad de suplentes es ilimitada; los cambios durante el partido ser?n 5, los cuales NO son rotativos, un jugador que sali?, no puede volver a ingresar.</p>\r\n                                <p>Los jugadores NO pueden jugar con tapones de aluminio.</p>\r\n                                <h5><b>Art. 8. MECANISMO DEL TORNEO:</b></h5>\r\n                                <p><b>A:</b> El torneo se desarrollara en 3 zonas de 10 equipos cada una (Zona A , Zona B y Zona C), jug?ndose en cada una de ellas dos rondas de todos contra todos. (Ida y vuelta, 18 fechas en total)</p>\r\n                                <p><b>B:</b> Partido ganado: 3 puntos.</p>\r\n                                <p>Partido empatado: 1 punto para ambos equipos.</p>\r\n                                <p>Partido perdido: 0 puntos.</p>\r\n\r\n                                <h5>Al finalizar el torneo, los 3 ?ltimos de cada zona descender?n y los 3 primeros ascender?n.</h5>\r\n\r\n                                <h5><b>C: COPA FAIR PLAY</b></h5>\r\n\r\n                                <p>El equipo que llegue a sumar 60 puntos de Fair Play, ser? expulsado del Torneo. </p>\r\n                                <p>Aclaraci?n: La expulsi?n del equipo del torneo queda a decisi?n de la organizaci?n cuando se realizara (si durante el transcurso del torneo, o al finalizar el torneo).</p>\r\n\r\n                                <p>1 punto por cada tarjeta amarilla.</p>\r\n                                <p>3 puntos por no presentarse con camisetas iguales y numeradas.</p>\r\n                                <p>3 puntos por cada tarjeta roja.</p>\r\n                                <p>5 puntos por no presentarse, con aviso antes de las 14pm del d?a anterior a la fecha.</p>\r\n                                <p>10 puntos por no presentarse, sin aviso o antes de las 10am del d?a de la fecha.</p>\r\n                                <br>\r\n                                <p>Exclusi?n de la copa, si no se presenta, de o no de aviso. (10 puntos para la definici?n).</p>\r\n                                <p>El ganador de la Copa Fair Play, tendr? la inscripci?n GRATUITA para el pr?ximo Torneo.</p>\r\n                                <p>Los equipos nuevos, no participan de esta Copa.</p>\r\n\r\n                                <blockquote>Aclaraci?n: En caso de empate: Ganara el que haya asistido a m?s partidos, si persiste el empate, el que menos tarjetas rojas tenga, luego el que menos tarjetas amarillas tenga, en ?ltima instancia, por las posiciones del Torneo.</blockquote>\r\n\r\n                                <h5><b>Art. 9. MODIFICACIONES:</b></h5>\r\n                                <p><b>A:</b> Los organizadores se reservan la posibilidad de modificar el reglamento en cualquier momento. Las modificaciones siempre ser?n a futuro; y empezar?n a regir en la fecha siguiente de ser conocidas. Se dar?n a conocer en la p?gina principal <strong>(secci?n "AVISOS IMPORTANTES")</strong>.</p>\r\n                                <p><b>B:</b> Este reglamento se tendr? por conocido por todos los jugadores del torneo, y por el p?blico en general.</p>\r\n                                <p>La organizaci?n le quiere dar la bienvenida a los equipos y contarles que los objetivos del torneo no son otros que juntar grupos de amigos para <strong>JUGAR</strong> s?bado a s?bado y disfrutar lo que tanto nos apasiona que es El F?tbol.</p>\r\n\r\n                                <br>\r\n                                <h5>Queremos darle las gracias por interpretar nuestros objetivos y fomentar entre todos el <strong>BUEN AMBIENTE EN EL PREDIO!</strong></h5>\r\n                                <br>\r\n                                <h4>Atte. La Organizaci?n.</h4>\r\n                      </div>\r\n                    </div>\r\n                    \r\n                    \r\n                    </div>', 2);
INSERT INTO `tbcontenidos` (`idcontenido`, `texto`, `refseccion`) VALUES
(3, '<div id="reglamento" class="row" style="margin-top:20px; padding-left:40px; padding-right:40px;">\r\n                    	<h1>PREDIO 98</h1>\r\n                        <h3>Premios</h3>\r\n                        \r\n                        \r\n                        <h4>-Premios por Equipos</h4>\r\n                        <div align="center">\r\n                        <p>-1er Puesto: JUEGO DE CAMISETAS (14 / F11) / (10 / F7) + PELOTA + TROFEO + 7kg ASADO PARA EL EQUIPO (F11) / 5kg (F7) !</p>\r\n                        <p>-2do Puesto: JUEGO DE CAMISETAS (14 / F11) / (10 / F7) + TROFEO</p>\r\n                        <p>-3er Puesto: PELOTA + TROFEO</p>\r\n                        </div>\r\n                        <h4>-Premios por Goleador General del Torneo: BOTINES + TROFEO</h4>\r\n                        \r\n                        <h4>-Premios por Valla menos vencida General del Torneo: GUANTES + TROFEO</h4>\r\n                        \r\n                        <h4>-Premio Copa Fair Play General del Torneo: INSCRIPCION GRATUITA AL PROXIMO TORNEO. </h4>\r\n                        <div style="height:100px;">\r\n                        \r\n                        </div>\r\n                    </div>', 3),
(4, '<ul>\r\n                        	<li>A solo 10 minutos del centro. (Calle 98 y 16)</li>\r\n                            <li>8 Canchas de Futbol 11</li>\r\n                            <li>4 Canchas de Futbol 7</li>\r\n                            <li>Tiempos de 35'' (F11) / 25'' (F7)</li>\r\n                            <li>Vestuarios con DUCHAS calientes.</li>\r\n                            <li>Dos pelotas por cancha (Adidas y Nike 100% oficiales de Primera Division)</li>\r\n                            <li>DOS Ambulancias con MEDICO de Alta Complejidad de la empresa Sante.</li>\r\n                            <li>Estacionamiento privado y gratis para mas de 300 vehiculos.</li>\r\n                            <li>Alcanza Pelotas.</li>\r\n                            <li>Para-pelotas detras de todos los arcos.</li>\r\n                            <li>Arbitros oficiales.</li>\r\n                            <li>Seguridad privada.</li>\r\n                            <li>Fotografo.</li>\r\n                            <li>Buffet con parrilla.</li>\r\n                            <li>Agua en TODAS las canchas.</li>\r\n                            <li>Ba�os dama y caballero.</li>\r\n                        </ul>', 4),
